6	2	<p><strong>1. How many cities do Emirates quotation operates in?</strong></p>\r\n\n<p>This Dubai based services start-up has grown all over UAE and has plans to expand in the MENA region and beyond.</p>\r\n\n<p><strong>2. Are your service vendors qualified?</strong></p>\r\n\n<p>Yes! We only partner with best vendors in the market who are recommended and certified by experts.</p>\r\n\n<p><strong>3. Can I place a service request without registering in the app or site?</strong></p>\r\n\n<p>We highly recommend you to register with us. All the data given by you will be handled cautiously.</p>\r\n\n<p><strong>4. How do I find a service provider?</strong></p>\r\n\n<p>First step is to register with Emirates Quotation.</p>\r\n\n<p>Choose a service that you would like to order.</p>\r\n\n<p>Ask for quotes.</p>\r\n\n<p>Get free quotes from service providers, compare, and finalise the one which suits you.</p>\r\n\n<p><strong>5. How do I download the APP?</strong></p>\r\n\n<p>Go to Google play store search for Emirates quotation. Click on install and you are done.</p>\r\n\n<p>Apple users can download from App store.</p>\r\n\n<p><strong>6. How do I reschedule a job already booked?</strong></p>\r\n\n<p>You can contact the service provider with whom you have scheduled an appointment with and reschedule the appointment on a convenient date.</p>\r\n\n<p><strong>7. How do I make payments to the customers?</strong></p>\r\n\n<p>You can make payments to the vendor directly once the job is complete.</p>	1	2018-08-31 15:02:18	2019-07-19 06:49:54	6
