icipate in certain features of the Platform, you will need to create a password-protected account (&amp;quot;Account&amp;quot;). You may also register an Account using your existing Google/Facebook account or log-in credentials (your &amp;quot;Third-Party Website Password&amp;quot;). You agree to provide accurate, recent and complete information during the registration or request process and at all times while using the&amp;nbsp;Platform, so as to keep the information up-to date, accurate and complete. You are solely responsible for the protection of your password on the website and, where applicable, your password on the third-party website. You are solely responsible for all activities that take place on your account and you will immediately notify any unauthorized use of the website. Website cannot be held responsible for any losses caused by unauthorized use of your account by any party. Notwithstanding the above, due to such unlawful use, you may be responsible for website or other losses.&lt;/p&gt;\r\n\r\n&lt;p&gt;We reserve the right to disable/finish the vhelp.com account without any refunds if the providers:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Have given incorrect information and/or documentation.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Acted in bad faith.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Re-registered on the platform for violation of terms under distinct trade licenses.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Registering under shell/ghost companies.&amp;nbsp;&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Failure to submit records for verification purposes.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;If recognized by UAE&amp;rsquo;s Government officials as a fugitive or money launderer.&lt;/p&gt;\r\n\t&lt;/li&gt;\r\n\t&lt;li&gt;\r\n\t&lt;p&gt;Selling client information to companies not registered/verified by&amp;nbsp; vhelp.com.&lt;/p&gt;\r\n\t&lt;/li&gt;