tracts, statements and treaties, whether oral or written.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>2. SERVICES</strong></p>\r\n\r\n<p>The Platform&#39;s services (&quot;Services&quot;) include active online service directory that provides businesses, traders, including freelancers (&quot;Providers&quot;) to publish demands on the platform. Website customers will post the requirements, and Providers will send the quotations. The Platform lists and sells their products to users at <a href="http://www.eqonline.ae/">www.eqonline.ae</a>. To be noted that the website only helps facilitate transactions performed on this platform, it is neither the buyer nor the vendor of the products or services provided by the provider. We provide a place to negotiate and make transactions for suppliers and buyers. Accordingly, the contract formed at the completion of a sale for these third-party products or services is solely between buyer and provider. Eqonline.ae is not a party to this agreement, nor does it assume any liability resulting from or in association with it, nor is it the agent of the provider. The provider is liable for selling the products and services and dealing with any purchaser allegations or other issues resulting from or in connection with the buyer-provider agreement.</p>\r\n\r\n<p><strong>3.&nbsp;ACCOUNT REGISTRATION</strong></p>\r\n\r\n<p>Users may access the Platform without registering for an account. To access and participate in certain features of the Platform, you will need to create a password-protected account (&quot;Account&quot;). You may also register an Account using your existing Google/Facebook account or log-in credentials (your &quot;Third-Party Website Password&quot;). You agree to provide accurate, recent and complete information during the registration or request process and at all times while using the&nbsp;Platform, so as to keep the information up-to date, accurate and complete. You are solely responsible for 