ongoing basis and it is appropriate for any legitimate purpose;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You warrant that the owner of any rights, including moral rights in such Content, and&nbsp;has fully and efficiently renounced all such privileges and has validly and irrevocably given you the right to grant the permit in the previous phrase;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You allow access, display, view, store and replicate any other user of the Platform;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You grant the Platform the right to ban any party from subsequently accessing, storing and reproducing or using such Content to the extent that the Platform considers fit.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform&nbsp;is not responsible for, and no reliance should be placed, in any way on any Content posted, transmitted through or linked to the Platform.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform reserves the right to (i) refuse to share or display, (ii) move; or (iii) delete any Content posted on the Platform.&nbsp;</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>4.2 Rating</strong></p>\r\n\r\n<p>&quot;Rating&rdquo; implies to any ratings and/or comments posted by customers/clients on Businesses in which the performance of Businesses is rated. By posting Ratings on the Platform, you warrant that:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>You are or have been a customer/client/user of the Business;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The statements of fact reflected in the ratings and/or comments posted by you are true and are not materially different from the truth;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The opinions reflected in the ratings and/or comments posted by you are genuine and honestly held by you;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You will not use obscene or offensive language or submit any material that is, or may potentially be, defamatory, abusive or hateful, an invasion of anyone&#39;s privacy, harmful to other users, harmful to the business interests of the Platform, or encourages conduct that would constitute a criminal offence, give rise to civil liability, or otherwise violate any local, national or international law or regulation;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You will not submit or post any material which constitutes junk mail or unauthorized advertising, including solicitation of other users to buy or sell any products or services without the prior written consent of the Platform.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform is not liable for testing, editorial or other control of ratings, remarks or other content, and you recognize that the Website may include material that may be considered disagreeable, false, incorrect, offensive or otherwise objectionable.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform assumes no accountability or responsibility for the preservation of the material on the Website and may, at its sole discretion, alter or remove it.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><a href="http://www.eqonline.ae/">www.eqonline.ae</a> maintains a strict policy for poor ratings. After&nbsp;assessment, if a service provider receives 3 (three) bad ratings in a 3 (three) month period, your account will be deactivated for a period of&nbsp;1 (one) month.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>5.&nbsp;PROVIDERS</strong></p>\r\n\r\n<p><strong>5.1 Usage</strong></p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>If you are a Provider or you as an individual or your company registered with the Platform for your company / business, the terms and conditions set out in this Clause 5 shall apply as well.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>By registering or using the Platform to deliver, post or provide Items or Services, Providers represent and warrant that they and their staff, agents, contractors and subcontractors who may carry out work for them are adequately and fully skilled and experienced and are licensed, certified, bonded and insured, as needed by relevant legislation or regulations and in relation to their work. Providers know and agree that sending a quote does not ensure that the quote will be read and does not ensure using the Platform that they will be recruited for the requirement.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform, subject to these terms and conditions, grants you a limited, non-exclusive, revocable, non-transferable, and non-sub licensable license to reproduce and display Content (excluding any software source code) solely for your personal and non-commercial use and only in connection with your access to and participation in the Platform. You shall not use, copy, adapt, alter, prepare, distribute, license, sell, transfer, publicly display, openly execute, transmit, stream, broadcast or otherwise utilize the Platform or Content, except as expressly allowed in these Terms. You are given with the Platform and Content as it is. You must maintain all copyright and other proprietary notices contained thereon if you download or print a copy of Content for private use.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>By posting or submitting material about your Business on the Website, you warrant that i) All such material is not private and is intended for publication on the Website ii) You grant the Website has unrestricted right to use, reproduce, modify, translate and distribute any material you post or submit to the Website in any medium and for any purpose, including commercial use iii) All such materials are truthful and accurate to the best of your knowledge iv) You will not use obscene or offensive language or submit any material that is, or may be, defamatory, abusive or hateful, invasive of the privacy of any person, harmful to other users, harmful to the Website&#39;s business interests or encourage conduct that would constitute a criminal offense, give rise to civil offenses, or otherwise violate any local, national or international law or regulation.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You agree not to publish or encourage or procure others to publish any untrue, incorrect or false comments and/or ratings about your business on the Website.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You agree that your login information will not be disclosed to third parties. If you do so, you shall be responsible for any violation by third parties of these Terms and Conditions using your login information and the compensation referred to in Clause 11 below shall be expanded accordingly.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>5.2&nbsp;Fees and Payments</strong></p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Eqonline.ae costs certain fees in connection with Platform use from the Providers (&quot;Subscription Fee&rdquo;) It is AED 5,000 for a year. Fees for additional products / services will be shown in&nbsp;policies&nbsp;or terms provided to you before you use such products or services. You agree to pay all relevant fees or fees depending on them, then in effect terms of fees and accounting, irrespective of whether you have an active account. You explicitly agree that all communication is to be made by electronic mail or telephone regarding delinquent accounts or fees due. The company or anyone on its behalf, including but not restricted to a third-party collection agent, may make such communication.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You recognize that the Platform may boost or decrease its fees or credits, and/or may launch campaigns from time to time, and that you will receive appropriate notice of changes to the fees in these Terms and Conditions.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You recognize and agree that the Platform has the right to withdraw the registration advantages or remove your business from the Platform in case you fail to pay.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Charges shall be levied on your credit card or other method of payment specified at the moment of purchase or registration of a service.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The use of the platform can be purchased by the Providers paying annual subscription fee of AED 5,000.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Payment method, approved card types and Currency: We accept internet payments using credit / debit card Visa and Master Card in AED and or direct bank transfer.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>If payment is made by credit card; the cardholder must keep a copy of the transaction documents and the policies and rules of the Emirates Quotation Online LLC.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>If the Business makes the payment by credit card; and registers the credit card in its Business Account; the website will automatically recharge the Business if the account balance decreases below zero dirhams (&quot;Auto-recharge&quot;) until the Business cancels the Auto-recharge option.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><strong>6.&nbsp;TERMS OF USE</strong></p>\r\n\r\n<p>You agree not to publish, email or make any content and/or ratings that are objectionable to the Platform or contrary to relevant legislation or regulations accessible through the Platform like:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>False or deceptive; unlawful, harmful, threatening, abusive, defamatory;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Of a political nature and/or is critical of any government or municipal employee in any jurisdiction;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Is racist or discriminatory in relation to any race, religion, creed, ethnicity, sexuality or other group of individuals harmful to minors;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Impersonates any another person;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Personally, identifiable other person data without their consent;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Requests the sale of products or services, except when (i) registered for such sales in the appropriate section of the Platform or (ii) emailed to another Platform customer who expressly wishes to be contacted by you;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Includes links to other websites, except when (i) expressly approved by Website in writing, and (ii) posted in a posting uploaded by you in the appropriately designated area;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Advertises the sale of any illegal product in accordance with any applicable law or regulation in the jurisdiction to which you sell the item;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Violates any applicable international, federal, national, local copyright, patent, trademark or other intellectual property laws;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Contains any malicious or technologically damaging software viruses, Trojans, worms, logic bombs or other content.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Pornographic or any kind of nudity, sexually explicit or perverse content;&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Material related to terrorist or supporting acts.&nbsp;</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>You further agree not to use the Platform to:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>Post, email, make any spam, junk mail, chain letters, pyramid or Ponzi schemes or unsolicited email ads accessible through the Platform or any other Platform user;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Attempts to gain unauthorized access to the Platform, the server on which the Platform is stored or to any server, computer or database connected to the Platform.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p>You must not use the website in any manner that is illegitimate, illegal, fraudulent or dangerous, or in association with any intent or activity that is illegitimate, illegal, fraudulent or dangerous. The above list of prohibited content and actions is not exhaustive and Website reserves the right to (i) remove any content that it considers (in its absolute and sole discretion) to be objectionable or in contradiction to applicable laws or regulations without notice; and (ii) Take the required measures to stop people from accessing the Platform by publishing content and/or ratings and/or by conducting themselves against Clause 5.<br />\r\n<br />\r\n<strong>7. DISCLAIMER</strong></p>\r\n\r\n<p>You expressly understand and agree that:</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>At your sole risk, you use the Website. The Platform disclaims and excludes any implied circumstances or warranties to the maximum extent allowed by law.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>It is forbidden to post any content that violates any international, federal, national, local copyright, patent, trademark or other intellectual property laws applicable in the United Arab Emirates. The Platform is not responsible for any content submitted by a user that infringes another&rsquo;s proprietary rights.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform does not warrant that the Services given will be uninterrupted, timely, safe or error-free, or that any data supplied on the Website (including content and/or ratings) is precise, error-free or reliable.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform does not warrant for any purpose the accuracy, adequacy, quality, currency, validity, completeness or appropriateness of the Services or any other information on this Website. On the grounds of &quot;as is&quot; and &quot;as appropriate,&quot; the Website and Services are given.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform does not warrant that viruses, worms, Trojan horses or anything else that contains damaging characteristics will free this Website and the Services.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>No advice or data acquired from the Website or the Platform or from anyone else will generate any warranty from the Platform not expressly indicated in these terms and conditions.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform makes no warranties regarding the undertakings featured or suggested on this Website or the services conducted by those undertakings, including the facilities given by those undertakings appointed to perform employment published on the Platform jobs.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform does not necessarily endorse, assist, sanction, promote, check or agree with the website users &#39; ratings and/or remarks.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Responsibility for the content of advertisements appearing on this&nbsp;website&nbsp;(including hyperlinks to advertisers&#39; own websites) rests solely with the advertisers. The placement of such advertisements on the&nbsp;website&nbsp;does not constitute the Platform&rsquo; recommendation or endorsement of the advertised product or service. Each advertiser is solely responsible for any representation made in connection with its advertisement.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform and Services may contain links to other websites operated by third parties. The Platform does not control such websites and is not responsible for their content, privacy policies, or their use of Personal Information. Any information submitted by you directly to these third parties is subject to third-party&#39;s terms and conditions.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Under no circumstances shall the Platform be liable for any loss arising from or in connection with the use or performance of this Website by you or others, whether direct or indirect, including, without limitation, loss of profits, loss of data, loss of business or anticipated savings, general and special damages, and consequential and incidental losses, whether at law or wrong or elsewhere.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>The Platform operates as an online community portal for customers/clients and Businesses.&nbsp;The Platform&nbsp;does not sell any item listed on the Website directly and is never a party to any transaction between Users. As a result, the Platform does not i) guarantee or ensure any item listed on the Platform or any service or transaction between Users, ii) collect or process payment or transfer of title on behalf of Users, or (iii) warehouse, store, ship or deliver any item listed on the Platform. Furthermore, the Platform is not responsible for any communication or dealing between you and one or more other the Platform users, and the Platform will not be liable for any such interactions or dealings in any manner whatsoever.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You will not hold the Platform responsible for other Users&#39; Content, actions or inactions. While we may help facilitate the resolution of disputes, the Platform is not obliged to participate in any dispute between you and other User(s) of the Platform. We have no control over and do not guarantee the certainty, accuracy, quality, safety or legality of Content published; the ability of Businesses to perform the requirements, the ability of customers/clients to pay for such requirements.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You acknowledge that the Platform does not monitor, verify or approve&nbsp;Content,&nbsp;and that you are solely responsible for evaluating and verifying the accuracy of any Content posted on the Platform.</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>7.1 Advertisement</strong></p>\r\n\r\n<p>The Site may contain advertisements and/or sponsorships. The advertisers and/or sponsors that provide these advertisements and sponsorships are solely responsible for insuring that the materials submitted for inclusion on the Site are accurate and comply with all applicable laws. Emirates Quotation Online LLC is not responsible for the acts or omissions of any advertiser or sponsor.</p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<p><strong>8. INTELLECTUAL PROPERTY RIGHTS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>The pictures and logos of the platform cited in this website and the contents of this website are subject to our own intellectual property rights. Other product and company names referred to herein may be the corresponding owner&#39;s intellectual property.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Any rights not expressly granted herein are reserved. You agree not to breach any&nbsp;trade mark, copyright, patent, design or other rights in relation to all trademarks, information, images, logos and other intellectual property included in this Website. No logo, graphic, sound or image from this Website may be copied or retransmitted unless expressly permitted in writing by us.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You agree not to download, copy, transmit, &quot;data-mine&quot;, &quot;scrape&quot; or otherwise replicate any of the information on this Website, including Ratings, for any business purpose, whether by electronic or any other means whatsoever.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>You agree not to use any robot spider, scraper or other automated means to access the Platform and collect content for any purpose or otherwise copy or download content. A limited exception is granted to search engines and non-commercial public archives, but not for websites that include any form of commercial listings.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Without prior approval, you agree not to harvest or otherwise retrieve other data, including email addresses.&nbsp;</p>\r\n\t</li>\r\n</ul>\r\n\r\n<p><strong>9. SECURITY MEASURES</strong></p>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p>To prevent unauthorized access, maintain&nbsp;accuracy&nbsp;of our records and to ensure proper use and protection of your information, we have put appropriate physical, electronic and managerial procedures in place.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>We have in place administrative, technical, and physical measures to protect the information we collect online. However, we cannot guarantee the security of our database, nor can we guarantee that the information you supply will not be intercepted while being transmitted to us over the internet.&nbsp;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>Cookies: We may place a &ldquo;cookie&rdquo; (a small, unique identifier text file) on your system to remember who you are. We also may include other information in our cookie files; for example, if you arrived at this website via a link from third-party website, we may include the URL of the