rong&amp;gt;D.&amp;nbsp;Security&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;lt;p&amp;gt;&amp;nbsp;We&amp;nbsp;employ&amp;nbsp;procedural&amp;nbsp;and&amp;nbsp;technological&amp;nbsp;security&amp;nbsp;measures,&amp;nbsp;which&amp;nbsp;are&amp;nbsp;reasonably&amp;nbsp;designed&amp;nbsp;to&amp;nbsp;help&amp;nbsp;protect&amp;nbsp;your&amp;nbsp;personal&amp;nbsp;information&amp;nbsp;from&amp;nbsp;unauthorized&amp;nbsp;access&amp;nbsp;or&amp;nbsp;disclosure.&amp;nbsp;Vhelp&amp;nbsp;may&amp;nbsp;use&amp;nbsp;encryption,&amp;nbsp;passwords,&amp;nbsp;and&amp;nbsp;physical&amp;nbsp;security&amp;nbsp;measures&amp;nbsp;to&amp;nbsp;help&amp;nbsp;protect&amp;nbsp;your&amp;nbsp;personal&amp;nbsp;information&amp;nbsp;against&amp;nbsp;unauthorized&amp;nbsp;access&amp;nbsp;and&amp;nbsp;disclosure.&amp;nbsp;No&amp;nbsp;security&amp;nbsp;measures,&amp;nbsp;however,&amp;nbsp;are&amp;nbsp;100%&amp;nbsp;complete.&amp;nbsp;Therefore,&amp;nbsp;we&amp;nbsp;do&amp;nbsp;not&amp;nbsp;promise&amp;nbsp;and&amp;nbsp;cannot&amp;nbsp;guarantee,&amp;nbsp;and&amp;nbsp;thus&amp;nbsp;you&amp;nbsp;should&amp;nbsp;not&amp;nbsp;expect,&amp;nbsp;that&amp;nbsp;your&amp;nbsp;personal&amp;nbsp;information&amp;nbsp;or&amp;nbsp;private&amp;nbsp;communications&amp;nbsp;will&amp;nbsp;not&amp;nbsp;be&amp;nbsp;collected&amp;nbsp;and&amp;nbsp;used&amp;nbsp;by&amp;nbsp;others.&amp;nbsp;You&amp;nbsp;should&amp;nbsp;take&amp;nbsp;steps&amp;nbsp;to&amp;nbsp;protect&amp;nbsp;against&amp;nbsp;unauthorized&amp;nbsp;access&amp;nbsp;to&amp;nbsp;your&amp;nbsp;password,&amp;nbsp;phone,&amp;nbsp;and&amp;nbsp;computer&amp;nbsp;by,&amp;nbsp;among&amp;nbsp;other&amp;nbsp;things,&amp;nbsp;signing&amp;nbsp;off&amp;nbsp;after&amp;nbsp;using&amp;nbsp;a&amp;nbsp;shared&amp;nbsp;computer,&amp;nbsp;choosing&amp;nbsp;a&amp;nbsp;robust&amp;nbsp;password&amp;nbsp;that&amp;nbsp;nobody&amp;nbsp;else&amp;nbsp;knows&amp;nbsp;or&amp;nbsp;can&amp;nbsp;easily&amp;nbsp;guess,&amp;nbsp;and&amp;nbsp;keeping&amp;nbsp;your&amp;nbsp;log-in&amp;nbsp;and&amp;nbsp;password&amp;nbsp;private.&amp;nbsp;Vhelp&amp;nbsp;is&amp;nbsp;not&amp;nbsp;responsible&amp;nbsp;for&amp;nbsp;the&amp;nbsp;unauthorized&amp;nbsp;use&amp;nbsp;of&amp;nbsp;your&amp;nbsp;information&amp;nbsp;or&amp;nbsp;for&amp;nbsp;any&amp;nbsp;lost,&amp;nbsp;stolen,&amp;nbsp;compromised&amp;nbsp;passwords,&amp;nbsp;or&amp;nbsp;for&amp;nbsp;any&amp;nbsp;activity&amp;nbsp;on&amp;nbsp;your&amp;nbsp;Account&amp;nbsp;via&amp;nbsp;unauthorized&amp;nbsp;password&amp;nbsp;activity.&amp;lt;/p&amp;gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;lt;p&amp;gt;&amp;nbsp;&amp;lt;strong&amp;gt;E.&amp;nbsp;Disclosure&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;lt;p&amp;gt;&amp;nbsp;We&amp;nbsp;may&amp;nbsp;share&amp;nbsp;the&amp;nbsp;information&amp;nbsp;that&amp;nbsp;we&amp;nbsp;collect&amp;nbsp;about&amp;nbsp;you,&amp;nbsp;including&amp;nbsp;your&amp;nbsp;personal&amp;nbsp;information,&amp;nbsp;as&amp;nbsp;follows:&amp;lt;/p&amp;gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;lt;p&amp;gt;&amp;nbsp;&amp;lt;strong&amp;gt;1.&amp;nbsp;INFORMATION&amp;nbsp;DISCLOSED&amp;nbsp;TO&amp;nbsp;PROTECT&amp;nbsp;US&amp;nbsp;AND&amp;nbsp;OTHERS&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;lt;p&amp;gt;&amp;nbsp;We&amp;nbsp;may&amp;nbsp;disclose&amp;nbsp;your&amp;nbsp;information&amp;nbsp;including&amp;nbsp;Personal&amp;nbsp;Information&amp;nbsp;if:&amp;nbsp;(i)&amp;nbsp;Vhelp&amp;nbsp;reasonably&amp;nbsp;believes&amp;nbsp;that&amp;nbsp;disclosure&amp;nbsp;i