10	2	<p>&lt;p&gt;&nbsp;This&nbsp;Terms&nbsp;of&nbsp;Use&nbsp;agreement&nbsp;was&nbsp;last&nbsp;updated:&nbsp;August&nbsp;27th,&nbsp;2020.&nbsp;This&nbsp;Privacy&nbsp;Policy&nbsp;agreement&nbsp;is&nbsp;effective&nbsp;as&nbsp;of:&nbsp;December&nbsp;22nd,&nbsp;2014&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Vhelp&nbsp;Technologies&nbsp;India&nbsp;Pvt.&nbsp;Ltd&nbsp;(&quot;Vhelp&quot;)&nbsp;values&nbsp;your&nbsp;privacy.&nbsp;In&nbsp;this&nbsp;Privacy&nbsp;Policy&nbsp;(&quot;Policy&quot;),&nbsp;we&nbsp;describe&nbsp;the&nbsp;information&nbsp;that&nbsp;we&nbsp;collect&nbsp;about&nbsp;you&nbsp;when&nbsp;you&nbsp;visit&nbsp;our&nbsp;website,&nbsp;www.Vhelp.com&nbsp;(the&nbsp;&quot;Website&quot;)&nbsp;and&nbsp;use&nbsp;the&nbsp;services&nbsp;available&nbsp;on&nbsp;the&nbsp;Website&nbsp;(&quot;Services&quot;),&nbsp;and&nbsp;how&nbsp;we&nbsp;use&nbsp;and&nbsp;disclose&nbsp;that&nbsp;information.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;If&nbsp;you&nbsp;have&nbsp;any&nbsp;questions&nbsp;or&nbsp;comments&nbsp;about&nbsp;the&nbsp;Privacy&nbsp;Policy,&nbsp;please&nbsp;contact&nbsp;us&nbsp;at&nbsp;support@urbancompany.com.&nbsp;This&nbsp;Policy&nbsp;is&nbsp;incorporated&nbsp;into&nbsp;and&nbsp;is&nbsp;subject&nbsp;to&nbsp;the&nbsp;Vhelp&nbsp;Terms&nbsp;of&nbsp;Use,&nbsp;which&nbsp;can&nbsp;be&nbsp;accessed&nbsp;at&nbsp;www.Vhelp.com/terms&nbsp;.&nbsp;Your&nbsp;use&nbsp;of&nbsp;the&nbsp;Website&nbsp;and/or&nbsp;Services&nbsp;and&nbsp;any&nbsp;personal&nbsp;information&nbsp;you&nbsp;provide&nbsp;on&nbsp;the&nbsp;Website&nbsp;remains&nbsp;subject&nbsp;to&nbsp;the&nbsp;terms&nbsp;of&nbsp;the&nbsp;Policy&nbsp;and&nbsp;Vhelp&#39;s&nbsp;Terms&nbsp;of&nbsp;Use.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;In&nbsp;terms&nbsp;of&nbsp;the&nbsp;Information&nbsp;Technology&nbsp;(Intermediaries&nbsp;Guidelines)&nbsp;Rules,&nbsp;2011&nbsp;and&nbsp;the&nbsp;Information&nbsp;Technology&nbsp;(Reasonable&nbsp;Security&nbsp;Practices&nbsp;and&nbsp;Procedures&nbsp;and&nbsp;Sensitive&nbsp;Personal&nbsp;Data&nbsp;or&nbsp;Information)&nbsp;Rules,&nbsp;2011,&nbsp;any&nbsp;grievance&nbsp;or&nbsp;complaint&nbsp;may&nbsp;be&nbsp;intimated&nbsp;to&nbsp;Suhail&nbsp;Vadgaokar,&nbsp;Grievance&nbsp;Officer,&nbsp;who&nbsp;may&nbsp;be&nbsp;reached&nbsp;at&nbsp;Basement,&nbsp;Plot&nbsp;#112,&nbsp;Udyog&nbsp;Vihar,&nbsp;Phase&nbsp;4,&nbsp;Gurgaon&nbsp;-&nbsp;122015,&nbsp;India.&nbsp;The&nbsp;complaint&nbsp;shall&nbsp;be&nbsp;redressed&nbsp;within&nbsp;a&nbsp;period&nbsp;of&nbsp;1&nbsp;(one)&nbsp;month.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;A.&nbsp;Collection&nbsp;of&nbsp;Your&nbsp;Personal&nbsp;Information&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;1.&nbsp;COLLECTION&nbsp;OF&nbsp;PERSONAL&nbsp;INFORMATION&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&ldquo;Personal&nbsp;information&rdquo;&nbsp;is&nbsp;defined&nbsp;to&nbsp;include&nbsp;information&nbsp;that&nbsp;whether&nbsp;on&nbsp;its&nbsp;own&nbsp;or&nbsp;in&nbsp;combination&nbsp;with&nbsp;other&nbsp;information&nbsp;may&nbsp;be&nbsp;used&nbsp;to&nbsp;readily&nbsp;identify&nbsp;or&nbsp;contact&nbsp;you&nbsp;such&nbsp;as:&nbsp;name,&nbsp;address,&nbsp;email&nbsp;address,&nbsp;phone&nbsp;number&nbsp;etc.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;collect&nbsp;personal&nbsp;information&nbsp;from&nbsp;Service&nbsp;Professionals&nbsp;offering&nbsp;their&nbsp;products&nbsp;and&nbsp;services.&nbsp;This&nbsp;information&nbsp;is&nbsp;partially&nbsp;or&nbsp;completely&nbsp;accessible&nbsp;to&nbsp;all&nbsp;visitors&nbsp;using&nbsp;Vhelp&rsquo;s&nbsp;website&nbsp;or&nbsp;mobile&nbsp;application,&nbsp;either&nbsp;directly&nbsp;or&nbsp;by&nbsp;submitting&nbsp;a&nbsp;request&nbsp;for&nbsp;a&nbsp;service.&nbsp;Service&nbsp;Professionals&nbsp;and&nbsp;customers&nbsp;are&nbsp;required&nbsp;to&nbsp;create&nbsp;an&nbsp;account&nbsp;to&nbsp;be&nbsp;able&nbsp;to&nbsp;access&nbsp;certain&nbsp;portions&nbsp;of&nbsp;our&nbsp;Website,&nbsp;such&nbsp;as&nbsp;to&nbsp;submit&nbsp;questions,&nbsp;participate&nbsp;in&nbsp;polls&nbsp;or&nbsp;surveys,&nbsp;to&nbsp;request&nbsp;a&nbsp;quote,&nbsp;to&nbsp;submit&nbsp;a&nbsp;bid&nbsp;in&nbsp;response&nbsp;to&nbsp;a&nbsp;quote,&nbsp;and&nbsp;request&nbsp;information.&nbsp;-&nbsp;Service&nbsp;Professionals,&nbsp;if&nbsp;and&nbsp;when&nbsp;they&nbsp;create&nbsp;and&nbsp;use&nbsp;an&nbsp;account&nbsp;with&nbsp;Vhelp,&nbsp;will&nbsp;be&nbsp;required&nbsp;to&nbsp;disclose&nbsp;and&nbsp;provide&nbsp;to&nbsp;Vhelp&nbsp;information&nbsp;including&nbsp;personal&nbsp;contact&nbsp;details,&nbsp;bank&nbsp;details,&nbsp;personal&nbsp;identification&nbsp;details&nbsp;(such&nbsp;as&nbsp;PAN&nbsp;card,&nbsp;Aadhar&nbsp;card,&nbsp;phonebook,&nbsp;call&nbsp;logs&nbsp;etc.)&nbsp;and&nbsp;participate&nbsp;in&nbsp;polls&nbsp;or&nbsp;surveys&nbsp;or&nbsp;feedbacks&nbsp;etc.&nbsp;Such&nbsp;information&nbsp;gathered&nbsp;shall&nbsp;be&nbsp;utilized&nbsp;to&nbsp;ensure&nbsp;greater&nbsp;customer&nbsp;satisfaction&nbsp;and&nbsp;help&nbsp;a&nbsp;customer&nbsp;satiate&nbsp;their&nbsp;needs.&nbsp;The&nbsp;type&nbsp;of&nbsp;personal&nbsp;information&nbsp;that&nbsp;we&nbsp;collect&nbsp;from&nbsp;you&nbsp;varies&nbsp;based&nbsp;on&nbsp;your&nbsp;particular&nbsp;interaction&nbsp;with&nbsp;our&nbsp;Website&nbsp;or&nbsp;mobile&nbsp;application.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Consumers:&nbsp;During&nbsp;the&nbsp;Account&nbsp;registration&nbsp;process&nbsp;and&nbsp;during&nbsp;your&nbsp;usage&nbsp;of&nbsp;Vhelp&rsquo;s&nbsp;website&nbsp;or&nbsp;application,&nbsp;we&nbsp;will&nbsp;collect&nbsp;information&nbsp;such&nbsp;as&nbsp;your&nbsp;name,&nbsp;postal&nbsp;code,&nbsp;telephone&nbsp;email&nbsp;address&nbsp;and&nbsp;other&nbsp;personal&nbsp;information.&nbsp;You&nbsp;also&nbsp;may&nbsp;provide&nbsp;us&nbsp;with&nbsp;your,&nbsp;mailing&nbsp;address,&nbsp;and&nbsp;demographic&nbsp;information&nbsp;(e.g.,&nbsp;gender,&nbsp;age,&nbsp;political&nbsp;preference,&nbsp;education,&nbsp;race&nbsp;or&nbsp;ethnic&nbsp;origin,&nbsp;and&nbsp;other&nbsp;information&nbsp;relevant&nbsp;to&nbsp;user&nbsp;surveys&nbsp;and/or&nbsp;offers).&nbsp;We&nbsp;may&nbsp;also&nbsp;collect&nbsp;personal&nbsp;information&nbsp;that&nbsp;you&nbsp;post&nbsp;in&nbsp;your&nbsp;Offer,&nbsp;Profile,&nbsp;Wants,&nbsp;or&nbsp;Feedback,&nbsp;and&nbsp;any&nbsp;comments&nbsp;or&nbsp;discussions&nbsp;you&nbsp;post&nbsp;in&nbsp;any&nbsp;blog,&nbsp;chat&nbsp;room,&nbsp;or&nbsp;other&nbsp;correspondence&nbsp;site&nbsp;on&nbsp;the&nbsp;Website&nbsp;or&nbsp;mobile&nbsp;application,&nbsp;or&nbsp;any&nbsp;comments&nbsp;you&nbsp;provide&nbsp;during&nbsp;dispute&nbsp;resolution&nbsp;with&nbsp;other&nbsp;users&nbsp;of&nbsp;the&nbsp;Website&nbsp;or&nbsp;mobile&nbsp;application.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Service&nbsp;Professionals:&nbsp;If&nbsp;you&nbsp;are&nbsp;a&nbsp;Service&nbsp;Professional&nbsp;and&nbsp;would&nbsp;like&nbsp;to&nbsp;post&nbsp;any&nbsp;information&nbsp;about&nbsp;yourself,&nbsp;we&nbsp;will&nbsp;require&nbsp;you&nbsp;to&nbsp;register&nbsp;for&nbsp;an&nbsp;Account.&nbsp;During&nbsp;the&nbsp;Account&nbsp;registration&nbsp;process,&nbsp;we&nbsp;will&nbsp;collect&nbsp;your&nbsp;business&nbsp;name,&nbsp;telephone&nbsp;number,&nbsp;address,&nbsp;zip&nbsp;code,&nbsp;travel&nbsp;preferences,&nbsp;a&nbsp;description&nbsp;of&nbsp;your&nbsp;services,&nbsp;a&nbsp;headline&nbsp;for&nbsp;your&nbsp;profile,&nbsp;first&nbsp;and&nbsp;last&nbsp;name,&nbsp;and&nbsp;email&nbsp;address.&nbsp;Other&nbsp;information&nbsp;may&nbsp;also&nbsp;be&nbsp;required&nbsp;to&nbsp;be&nbsp;provided&nbsp;to&nbsp;Vhelp&nbsp;whilst&nbsp;you&nbsp;avail&nbsp;and&nbsp;use&nbsp;Vhelp&rsquo;s&nbsp;website&nbsp;or&nbsp;application.&nbsp;In&nbsp;addition,&nbsp;you&nbsp;may,&nbsp;but&nbsp;are&nbsp;not&nbsp;required&nbsp;to,&nbsp;provide&nbsp;other&nbsp;content&nbsp;or&nbsp;information&nbsp;about&nbsp;your&nbsp;business,&nbsp;including&nbsp;photographs&nbsp;and&nbsp;videos.&nbsp;We&nbsp;also&nbsp;may&nbsp;collect&nbsp;payment&nbsp;information,&nbsp;such&nbsp;as&nbsp;credit&nbsp;card&nbsp;information,&nbsp;from&nbsp;you.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Background&nbsp;Verification:&nbsp;The&nbsp;Service&nbsp;Professional&nbsp;acknowledges&nbsp;that&nbsp;as&nbsp;part&nbsp;of&nbsp;the&nbsp;on-boarding&nbsp;process,&nbsp;the&nbsp;Company&nbsp;or&nbsp;an&nbsp;entity&nbsp;/agency&nbsp;appointed&nbsp;or&nbsp;nominated&nbsp;by&nbsp;the&nbsp;Company&nbsp;(&ldquo;Verifier&rdquo;),&nbsp;may&nbsp;undertake&nbsp;background&nbsp;verification&nbsp;checks&nbsp;of&nbsp;the&nbsp;Service&nbsp;Professional&nbsp;in&nbsp;order&nbsp;to&nbsp;authenticate&nbsp;inter&nbsp;alia&nbsp;the&nbsp;genuineness&nbsp;and&nbsp;competency&nbsp;of&nbsp;the&nbsp;Service&nbsp;Professional.&nbsp;In&nbsp;light&nbsp;of&nbsp;the&nbsp;above,&nbsp;the&nbsp;Service&nbsp;Professional&nbsp;expressly&nbsp;consents&nbsp;to&nbsp;and&nbsp;acknowledges&nbsp;the&nbsp;following:&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;ul&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;i)&nbsp;The&nbsp;Service&nbsp;Professional&nbsp;does&nbsp;not&nbsp;and&nbsp;will&nbsp;not&nbsp;have&nbsp;any&nbsp;objection&nbsp;to&nbsp;Vhelp&nbsp;sharing&nbsp;the&nbsp;Service&nbsp;Professional&rsquo;s&nbsp;personal&nbsp;information&nbsp;and&nbsp;documents,&nbsp;including&nbsp;but&nbsp;not&nbsp;limited&nbsp;to&nbsp;name,&nbsp;gender,&nbsp;date&nbsp;of&nbsp;birth,&nbsp;addresses,&nbsp;mobile&nbsp;number,&nbsp;email,&nbsp;education&nbsp;record,&nbsp;employment&nbsp;record,&nbsp;Aadhaar&nbsp;number,&nbsp;other&nbsp;government&nbsp;issued&nbsp;IDs&nbsp;such&nbsp;as&nbsp;Voter&nbsp;ID,&nbsp;PAN&nbsp;card,&nbsp;driving&nbsp;license&nbsp;etc.&nbsp;(collectively&nbsp;&ldquo;Proprietary&nbsp;Information&rdquo;)&nbsp;with&nbsp;the&nbsp;Verifier&nbsp;for&nbsp;the&nbsp;purpose&nbsp;of&nbsp;background&nbsp;checks&nbsp;and&nbsp;verification.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;ii)&nbsp;The&nbsp;Service&nbsp;Professional&nbsp;authorizes&nbsp;the&nbsp;Verifier&nbsp;to&nbsp;securely&nbsp;store&nbsp;the&nbsp;Service&nbsp;Professional&rsquo;s&nbsp;Proprietary&nbsp;Information&nbsp;on&nbsp;their&nbsp;platform&nbsp;and&nbsp;understands&nbsp;that&nbsp;the&nbsp;Verifier&nbsp;shall&nbsp;endeavour&nbsp;to&nbsp;ensure&nbsp;confidentiality&nbsp;of&nbsp;the&nbsp;same.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;iii)&nbsp;The&nbsp;Service&nbsp;Professional&nbsp;acknowledges&nbsp;that&nbsp;the&nbsp;digital&nbsp;record&nbsp;of&nbsp;the&nbsp;Proprietary&nbsp;Information&nbsp;on&nbsp;the&nbsp;Verifier&rsquo;s&nbsp;platform&nbsp;shall&nbsp;be&nbsp;accessible&nbsp;to&nbsp;Vhelp&nbsp;and&nbsp;Vhelp&nbsp;and&nbsp;their&nbsp;authorized&nbsp;users/partners/affiliates/contractors&nbsp;shall&nbsp;be&nbsp;entitled&nbsp;to&nbsp;access&nbsp;and&nbsp;update&nbsp;such&nbsp;digital&nbsp;record&nbsp;on&nbsp;the&nbsp;Verifier&rsquo;s&nbsp;platform,&nbsp;including&nbsp;data,&nbsp;documents,&nbsp;certificates,&nbsp;verification&nbsp;reports,&nbsp;references,&nbsp;testimonials,&nbsp;etc.&nbsp;and&nbsp;shall&nbsp;be&nbsp;entitled&nbsp;to&nbsp;use&nbsp;the&nbsp;related&nbsp;services&nbsp;provided&nbsp;via&nbsp;the&nbsp;Verifier&rsquo;s&nbsp;platform.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;iv)&nbsp;The&nbsp;Service&nbsp;Professional&nbsp;acknowledges&nbsp;that&nbsp;if&nbsp;the&nbsp;Service&nbsp;Professional&nbsp;is&nbsp;desirous&nbsp;of&nbsp;editing&nbsp;and/or&nbsp;deleting&nbsp;its&nbsp;digital&nbsp;record&nbsp;from&nbsp;the&nbsp;Verifier&rsquo;s&nbsp;platform,&nbsp;it&nbsp;shall&nbsp;be&nbsp;entitled&nbsp;to&nbsp;do&nbsp;so&nbsp;by&nbsp;sending&nbsp;an&nbsp;email&nbsp;to&nbsp;such&nbsp;email&nbsp;address&nbsp;of&nbsp;the&nbsp;Verifier&nbsp;which&nbsp;shall&nbsp;be&nbsp;immediately&nbsp;provided&nbsp;by&nbsp;the&nbsp;Company&nbsp;to&nbsp;the&nbsp;Service&nbsp;Professional,&nbsp;and&nbsp;in&nbsp;such&nbsp;a&nbsp;manner&nbsp;as&nbsp;the&nbsp;Verifier&nbsp;requires&nbsp;the&nbsp;same.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;v)&nbsp;Vhelp&nbsp;reserves&nbsp;its&nbsp;right&nbsp;to&nbsp;take&nbsp;appropriate&nbsp;actions&nbsp;(in&nbsp;its&nbsp;sole&nbsp;discretion)&nbsp;pursuant&nbsp;to&nbsp;the&nbsp;outcome&nbsp;of&nbsp;the&nbsp;background&nbsp;check&nbsp;and&nbsp;verification.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/ul&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Vhelp&nbsp;reserves&nbsp;the&nbsp;right&nbsp;to&nbsp;record&nbsp;the&nbsp;conversations&nbsp;between&nbsp;service&nbsp;professionals&nbsp;and&nbsp;consumers&nbsp;facilitated&nbsp;by&nbsp;Vhelp&nbsp;through&nbsp;the&nbsp;messaging/chat&nbsp;mechanism&nbsp;on&nbsp;the&nbsp;platform&nbsp;or&nbsp;the&nbsp;calls&nbsp;made&nbsp;through&nbsp;the&nbsp;virtual&nbsp;numbers&nbsp;provided&nbsp;to&nbsp;safeguard&nbsp;the&nbsp;privacy&nbsp;of&nbsp;consumers&nbsp;and&nbsp;service&nbsp;professionals.&nbsp;All&nbsp;the&nbsp;chat/messaging&nbsp;logs&nbsp;or&nbsp;call&nbsp;recordings&nbsp;can&nbsp;be&nbsp;used&nbsp;to&nbsp;but&nbsp;not&nbsp;limited&nbsp;to&nbsp;monitor&nbsp;and&nbsp;prohibit&nbsp;abuse,&nbsp;safeguard&nbsp;the&nbsp;rights&nbsp;of&nbsp;consumers&nbsp;and&nbsp;service&nbsp;professionals,&nbsp;resolve&nbsp;disputes.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;If&nbsp;we&nbsp;deem&nbsp;it&nbsp;necessary,&nbsp;in&nbsp;our&nbsp;sole&nbsp;and&nbsp;absolute&nbsp;discretion,&nbsp;we&nbsp;may&nbsp;also&nbsp;ask&nbsp;for&nbsp;and&nbsp;collect&nbsp;supplemental&nbsp;information&nbsp;from&nbsp;third&nbsp;parties,&nbsp;such&nbsp;as&nbsp;information&nbsp;about&nbsp;your&nbsp;credit&nbsp;from&nbsp;a&nbsp;credit&nbsp;bureau&nbsp;(to&nbsp;the&nbsp;extent&nbsp;permitted&nbsp;by&nbsp;law),&nbsp;or&nbsp;information&nbsp;to&nbsp;verify&nbsp;any&nbsp;identification&nbsp;details&nbsp;you&nbsp;provide&nbsp;during&nbsp;registration.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;2.&nbsp;COLLECTION&nbsp;OF&nbsp;PERSONAL&nbsp;INFORMATION&nbsp;FROM&nbsp;SOCIAL&nbsp;NETWORKING&nbsp;SITES&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;You&nbsp;may&nbsp;log&nbsp;into&nbsp;our&nbsp;Website&nbsp;through&nbsp;your&nbsp;Facebook&nbsp;account.&nbsp;If&nbsp;you&nbsp;do&nbsp;so,&nbsp;you&nbsp;must&nbsp;enter&nbsp;the&nbsp;email&nbsp;address&nbsp;and&nbsp;password&nbsp;that&nbsp;you&nbsp;use&nbsp;for&nbsp;your&nbsp;Facebook&nbsp;account.&nbsp;We&nbsp;will&nbsp;ask&nbsp;that&nbsp;you&nbsp;grant&nbsp;us&nbsp;permission&nbsp;to&nbsp;access&nbsp;and&nbsp;collect&nbsp;your&nbsp;Facebook&nbsp;basic&nbsp;information&nbsp;(this&nbsp;includes&nbsp;your&nbsp;name,&nbsp;profile&nbsp;picture,&nbsp;gender,&nbsp;networks,&nbsp;user&nbsp;IDs,&nbsp;list&nbsp;of&nbsp;friends,&nbsp;date&nbsp;of&nbsp;birth,&nbsp;email&nbsp;address,&nbsp;and&nbsp;any&nbsp;other&nbsp;information&nbsp;you&nbsp;have&nbsp;set&nbsp;to&nbsp;public&nbsp;on&nbsp;your&nbsp;Facebook&nbsp;account).&nbsp;If&nbsp;you&nbsp;allow&nbsp;us&nbsp;to&nbsp;have&nbsp;access&nbsp;to&nbsp;this&nbsp;information,&nbsp;then&nbsp;we&nbsp;will&nbsp;have&nbsp;access&nbsp;to&nbsp;this&nbsp;information&nbsp;even&nbsp;if&nbsp;you&nbsp;have&nbsp;chosen&nbsp;not&nbsp;to&nbsp;make&nbsp;that&nbsp;information&nbsp;public.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;store&nbsp;the&nbsp;information&nbsp;that&nbsp;we&nbsp;receive&nbsp;from&nbsp;Facebook&nbsp;with&nbsp;other&nbsp;information&nbsp;that&nbsp;we&nbsp;collect&nbsp;from&nbsp;you&nbsp;or&nbsp;receive&nbsp;about&nbsp;you.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Facebook&nbsp;controls&nbsp;the&nbsp;information&nbsp;it&nbsp;collects&nbsp;from&nbsp;you.&nbsp;For&nbsp;information&nbsp;about&nbsp;how&nbsp;Facebook&nbsp;may&nbsp;use&nbsp;and&nbsp;disclose&nbsp;your&nbsp;information,&nbsp;including&nbsp;any&nbsp;information&nbsp;you&nbsp;make&nbsp;public,&nbsp;please&nbsp;consult&nbsp;Facebook&#39;s&nbsp;privacy&nbsp;policy.&nbsp;We&nbsp;have&nbsp;no&nbsp;control&nbsp;over&nbsp;how&nbsp;any&nbsp;third&nbsp;party&nbsp;site&nbsp;uses&nbsp;or&nbsp;discloses&nbsp;the&nbsp;personal&nbsp;information&nbsp;it&nbsp;collects&nbsp;about&nbsp;you.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;3.&nbsp;COLLECTION&nbsp;OF&nbsp;AUTOMATIC&nbsp;INFORMATION,&nbsp;USE&nbsp;OF&nbsp;COOKIES&nbsp;AND&nbsp;OTHER&nbsp;TRACKING&nbsp;DEVICES&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;and&nbsp;our&nbsp;third&nbsp;party&nbsp;service&nbsp;providers,&nbsp;which&nbsp;include&nbsp;ad&nbsp;networks,&nbsp;use&nbsp;cookies,&nbsp;web&nbsp;beacons,&nbsp;and&nbsp;other&nbsp;tracking&nbsp;technologies&nbsp;to&nbsp;collect&nbsp;information&nbsp;about&nbsp;your&nbsp;use&nbsp;of&nbsp;our&nbsp;Website&nbsp;and&nbsp;Services,&nbsp;such&nbsp;as&nbsp;your&nbsp;browser&nbsp;type,&nbsp;your&nbsp;ISP&nbsp;or&nbsp;operating&nbsp;system,&nbsp;your&nbsp;domain&nbsp;name,&nbsp;your&nbsp;access&nbsp;time,&nbsp;the&nbsp;URL&nbsp;of&nbsp;the&nbsp;previous&nbsp;website&nbsp;you&nbsp;visited,&nbsp;your&nbsp;page&nbsp;views,&nbsp;your&nbsp;IP&nbsp;address,&nbsp;and&nbsp;the&nbsp;type&nbsp;of&nbsp;device&nbsp;that&nbsp;you&nbsp;use.&nbsp;We&nbsp;also&nbsp;track&nbsp;how&nbsp;frequently&nbsp;you&nbsp;visit&nbsp;our&nbsp;Website&nbsp;and&nbsp;use&nbsp;our&nbsp;Services.&nbsp;We&nbsp;use&nbsp;this&nbsp;information&nbsp;(including&nbsp;the&nbsp;information&nbsp;collected&nbsp;by&nbsp;our&nbsp;third&nbsp;party&nbsp;service&nbsp;providers)&nbsp;for&nbsp;Website&nbsp;analytics&nbsp;(including&nbsp;to&nbsp;determine&nbsp;which&nbsp;portions&nbsp;of&nbsp;our&nbsp;Website&nbsp;are&nbsp;used&nbsp;most&nbsp;frequently,&nbsp;what&nbsp;our&nbsp;users&nbsp;like/do&nbsp;not&nbsp;like),&nbsp;to&nbsp;assist&nbsp;us&nbsp;in&nbsp;determining&nbsp;relevant&nbsp;advertising&nbsp;(both&nbsp;on&nbsp;and&nbsp;off&nbsp;our&nbsp;Website),&nbsp;to&nbsp;evaluate&nbsp;the&nbsp;success&nbsp;of&nbsp;our&nbsp;advertising&nbsp;campaigns,&nbsp;and&nbsp;as&nbsp;otherwise&nbsp;described&nbsp;in&nbsp;this&nbsp;policy.&nbsp;Currently,&nbsp;we&nbsp;do&nbsp;not&nbsp;honour&nbsp;browser&nbsp;requests&nbsp;not&nbsp;to&nbsp;be&nbsp;tracked.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;obtain&nbsp;your&nbsp;device&nbsp;ID,&nbsp;which&nbsp;is&nbsp;sent&nbsp;to&nbsp;Vhelp&#39;s&nbsp;servers&nbsp;and&nbsp;used&nbsp;in&nbsp;fraud&nbsp;prevention&nbsp;efforts.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Cookies.&nbsp;We&nbsp;and&nbsp;our&nbsp;third&nbsp;party&nbsp;service&nbsp;providers&nbsp;collect&nbsp;information&nbsp;from&nbsp;you&nbsp;by&nbsp;using&nbsp;cookies.&nbsp;A&nbsp;cookie&nbsp;is&nbsp;a&nbsp;small&nbsp;file&nbsp;stored&nbsp;on&nbsp;user&#39;s&nbsp;computer&nbsp;hard&nbsp;drive&nbsp;containing&nbsp;information&nbsp;about&nbsp;the&nbsp;user.&nbsp;The&nbsp;cookie&nbsp;helps&nbsp;us&nbsp;analyze&nbsp;web&nbsp;traffic&nbsp;or&nbsp;informs&nbsp;you&nbsp;about&nbsp;your&nbsp;use&nbsp;of&nbsp;a&nbsp;particular&nbsp;website.&nbsp;Cookies&nbsp;allow&nbsp;web&nbsp;applications&nbsp;to&nbsp;respond&nbsp;to&nbsp;you&nbsp;as&nbsp;an&nbsp;individual,&nbsp;tailoring&nbsp;its&nbsp;operations&nbsp;to&nbsp;your&nbsp;needs,&nbsp;likes&nbsp;and&nbsp;dislikes&nbsp;by&nbsp;gathering&nbsp;and&nbsp;remembering&nbsp;information&nbsp;about&nbsp;your&nbsp;preferences.&nbsp;When&nbsp;you&nbsp;visit&nbsp;the&nbsp;Website,&nbsp;we&nbsp;may&nbsp;send&nbsp;one&nbsp;or&nbsp;more&nbsp;cookies&nbsp;(i.e.,&nbsp;a&nbsp;small&nbsp;text&nbsp;file&nbsp;containing&nbsp;a&nbsp;string&nbsp;of&nbsp;alphanumeric&nbsp;characters)&nbsp;to&nbsp;your&nbsp;computer&nbsp;that&nbsp;identifies&nbsp;your&nbsp;browser.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Some&nbsp;of&nbsp;these&nbsp;cookies&nbsp;may&nbsp;be&nbsp;connected&nbsp;to&nbsp;third-party&nbsp;companies&nbsp;or&nbsp;websites.&nbsp;The&nbsp;terms&nbsp;of&nbsp;use&nbsp;of&nbsp;such&nbsp;cookies&nbsp;are&nbsp;governed&nbsp;by&nbsp;this&nbsp;Policy&nbsp;and&nbsp;the&nbsp;privacy&nbsp;policy&nbsp;of&nbsp;the&nbsp;relevant&nbsp;third&nbsp;party&nbsp;company&nbsp;or&nbsp;website.&nbsp;For&nbsp;example,&nbsp;Google&nbsp;measures&nbsp;the&nbsp;performance&nbsp;of&nbsp;advertisements&nbsp;by&nbsp;placing&nbsp;cookies&nbsp;on&nbsp;your&nbsp;computer&nbsp;when&nbsp;you&nbsp;click&nbsp;on&nbsp;ads.&nbsp;If&nbsp;you&nbsp;visit&nbsp;the&nbsp;Website&nbsp;when&nbsp;you&nbsp;have&nbsp;such&nbsp;cookies&nbsp;on&nbsp;your&nbsp;computer,&nbsp;we&nbsp;and&nbsp;Google&nbsp;will&nbsp;be&nbsp;able&nbsp;to&nbsp;tell&nbsp;that&nbsp;you&nbsp;saw&nbsp;the&nbsp;ad&nbsp;delivered&nbsp;by&nbsp;Google.&nbsp;The&nbsp;terms&nbsp;of&nbsp;use&nbsp;of&nbsp;these&nbsp;cookies&nbsp;are&nbsp;governed&nbsp;by&nbsp;this&nbsp;Policy&nbsp;and&nbsp;Google&#39;s&nbsp;Privacy&nbsp;Policy.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Disabling&nbsp;Cookies.&nbsp;You&nbsp;can&nbsp;choose&nbsp;to&nbsp;accept&nbsp;or&nbsp;decline&nbsp;cookies.&nbsp;Most&nbsp;web&nbsp;browsers&nbsp;automatically&nbsp;accept&nbsp;cookies,&nbsp;but&nbsp;you&nbsp;can&nbsp;usually&nbsp;modify&nbsp;your&nbsp;browser&nbsp;setting&nbsp;to&nbsp;decline&nbsp;cookies&nbsp;if&nbsp;you&nbsp;prefer.&nbsp;If&nbsp;you&nbsp;disable&nbsp;cookies&nbsp;you&nbsp;may&nbsp;be&nbsp;prevented&nbsp;from&nbsp;taking&nbsp;full&nbsp;advantage&nbsp;of&nbsp;the&nbsp;Website&nbsp;because&nbsp;it&nbsp;may&nbsp;not&nbsp;function&nbsp;properly&nbsp;if&nbsp;the&nbsp;ability&nbsp;to&nbsp;accept&nbsp;cookies&nbsp;is&nbsp;disabled.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Clear&nbsp;GIFs,&nbsp;pixel&nbsp;tags&nbsp;and&nbsp;other&nbsp;technologies.&nbsp;Clear&nbsp;GIFs&nbsp;are&nbsp;tiny&nbsp;graphics&nbsp;with&nbsp;a&nbsp;unique&nbsp;identifier,&nbsp;similar&nbsp;in&nbsp;function&nbsp;to&nbsp;cookies.&nbsp;In&nbsp;contrast&nbsp;to&nbsp;cookies,&nbsp;which&nbsp;are&nbsp;stored&nbsp;on&nbsp;your&nbsp;computer&#39;s&nbsp;hard&nbsp;drive,&nbsp;clear&nbsp;GIFs&nbsp;are&nbsp;embedded&nbsp;invisibly&nbsp;on&nbsp;web&nbsp;pages.&nbsp;We&nbsp;may&nbsp;use&nbsp;clear&nbsp;GIFs&nbsp;(a.k.a.&nbsp;web&nbsp;beacons,&nbsp;web&nbsp;bugs&nbsp;or&nbsp;pixel&nbsp;tags),&nbsp;in&nbsp;connection&nbsp;with&nbsp;our&nbsp;Website&nbsp;to,&nbsp;among&nbsp;other&nbsp;things,&nbsp;track&nbsp;the&nbsp;activities&nbsp;of&nbsp;Website&nbsp;visitors,&nbsp;help&nbsp;us&nbsp;manage&nbsp;content,&nbsp;and&nbsp;compile&nbsp;statistics&nbsp;about&nbsp;Website&nbsp;usage.&nbsp;We&nbsp;and&nbsp;our&nbsp;third&nbsp;party&nbsp;service&nbsp;providers&nbsp;also&nbsp;use&nbsp;clear&nbsp;GIFs&nbsp;in&nbsp;HTML&nbsp;emails&nbsp;to&nbsp;our&nbsp;customers,&nbsp;to&nbsp;help&nbsp;us&nbsp;track&nbsp;email&nbsp;response&nbsp;rates,&nbsp;identify&nbsp;when&nbsp;our&nbsp;emails&nbsp;are&nbsp;viewed,&nbsp;and&nbsp;track&nbsp;whether&nbsp;our&nbsp;emails&nbsp;are&nbsp;forwarded.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;4.&nbsp;THIRD&nbsp;PARTY&nbsp;DATA&nbsp;POLICY&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;a.&nbsp;This&nbsp;app&nbsp;contains&nbsp;a&nbsp;software&nbsp;development&nbsp;kit&nbsp;(&ldquo;SDK&rdquo;)&nbsp;from&nbsp;a&nbsp;third&nbsp;party,&nbsp;Red&nbsp;Brick&nbsp;Lane&nbsp;Marketing&nbsp;Solutions&nbsp;Private&nbsp;Limited&nbsp;(&ldquo;RBL&rdquo;).&nbsp;The&nbsp;SDK&nbsp;is&nbsp;integrated&nbsp;with&nbsp;this&nbsp;app&nbsp;for&nbsp;the&nbsp;purposes&nbsp;of&nbsp;profiling&nbsp;the&nbsp;device&nbsp;on&nbsp;media&nbsp;consumption&nbsp;and&nbsp;other&nbsp;device&nbsp;data&nbsp;and&nbsp;utilizing&nbsp;the&nbsp;same&nbsp;to&nbsp;analyse&nbsp;media&nbsp;behaviour&nbsp;and/or&nbsp;target&nbsp;relevant&nbsp;content&nbsp;and&nbsp;ads&nbsp;to&nbsp;the&nbsp;device&nbsp;(&ldquo;Services&rdquo;)&nbsp;pursuant&nbsp;to&nbsp;the&nbsp;terms&nbsp;and&nbsp;conditions&nbsp;of&nbsp;RBL&nbsp;Services&nbsp;(&ldquo;Terms&nbsp;of&nbsp;Use&rdquo;).&nbsp;Further&nbsp;details&nbsp;can&nbsp;be&nbsp;obtained&nbsp;at&nbsp;http://www.zapr.in/privacy/&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;b.&nbsp;If&nbsp;you&nbsp;do&nbsp;not&nbsp;wish&nbsp;for&nbsp;RBL&nbsp;to&nbsp;identify&nbsp;television,&nbsp;radio&nbsp;and&nbsp;other&nbsp;offline&nbsp;content&nbsp;viewing&nbsp;around&nbsp;your&nbsp;mobile&nbsp;device,&nbsp;please&nbsp;opt&nbsp;out&nbsp;of&nbsp;all&nbsp;RBL&nbsp;Services&nbsp;via&nbsp;the&nbsp;following&nbsp;link:&nbsp;http://www.zapr.in/privacy/&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;c.&n