nbsp;risk&nbsp;of&nbsp;providing&nbsp;credit&nbsp;to&nbsp;Service&nbsp;Professionalsdesirous&nbsp;of&nbsp;obtaining&nbsp;short&nbsp;term&nbsp;credit&nbsp;from&nbsp;Vhelp&nbsp;(&ldquo;&nbsp;&lt;strong&gt;Services&nbsp;2&lt;/strong&gt;&rdquo;).&nbsp;MTPL&nbsp;shall&nbsp;have&nbsp;access&nbsp;to&nbsp;the&nbsp;following&nbsp;device&nbsp;data&nbsp;(only&nbsp;devices&nbsp;used&nbsp;to&nbsp;persons&nbsp;who&nbsp;want&nbsp;to&nbsp;avail&nbsp;short&nbsp;term&nbsp;credit&nbsp;from&nbsp;Vhelp)-&nbsp;transactional&nbsp;SMS,&nbsp;device&nbsp;metadata,&nbsp;location,&nbsp;apps&nbsp;list.&nbsp;Further&nbsp;details&nbsp;can&nbsp;be&nbsp;obtained&nbsp;at&nbsp;https://finbox.in/about/privacy&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;f.&nbsp;The&nbsp;data&nbsp;collected&nbsp;by&nbsp;MTPL&nbsp;may&nbsp;be&nbsp;disclosed&nbsp;to&nbsp;third&nbsp;parties&nbsp;and&nbsp;such&nbsp;Parties&nbsp;shall&nbsp;legally&nbsp;be&nbsp;bound&nbsp;to&nbsp;keep&nbsp;such&nbsp;data&nbsp;confidential.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;B.&nbsp;How&nbsp;Vhelp&nbsp;Uses&nbsp;the&nbsp;Information&nbsp;We&nbsp;Collect&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;1.&nbsp;HOW&nbsp;PERSONAL&nbsp;INFORMATION&nbsp;IS&nbsp;USED&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;ul&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;We&nbsp;collect&nbsp;your&nbsp;personal&nbsp;information&nbsp;and&nbsp;aggregate&nbsp;information&nbsp;about&nbsp;the&nbsp;use&nbsp;of&nbsp;our&nbsp;Website&nbsp;and&nbsp;Services&nbsp;to&nbsp;better&nbsp;understand&nbsp;your&nbsp;needs&nbsp;and&nbsp;to&nbsp;provide&nbsp;you&nbsp;with&nbsp;a&nbsp;better&nbsp;Website&nbsp;experience.&nbsp;Specifically,&nbsp;we&nbsp;may&nbsp;use&nbsp;your&nbsp;personal&nbsp;information&nbsp;for&nbsp;any&nbsp;of&nbsp;the&nbsp;following&nbsp;reasons:&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;provide&nbsp;our&nbsp;Services&nbsp;to&nbsp;you,&nbsp;including&nbsp;registering&nbsp;you&nbsp;for&nbsp;our&nbsp;Services,&nbsp;verifying&nbsp;your&nbsp;identity&nbsp;and&nbsp;authority&nbsp;to&nbsp;use&nbsp;our&nbsp;Services,&nbsp;and&nbsp;to&nbsp;otherwise&nbsp;enable&nbsp;you&nbsp;to&nbsp;use&nbsp;our&nbsp;Website&nbsp;and&nbsp;our&nbsp;Services;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;For&nbsp;customer&nbsp;support&nbsp;and&nbsp;to&nbsp;respond&nbsp;to&nbsp;your&nbsp;inquiries;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;For&nbsp;internal&nbsp;record-keeping&nbsp;purposes;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;process&nbsp;billing&nbsp;and&nbsp;payment,&nbsp;including&nbsp;sharing&nbsp;with&nbsp;third&nbsp;party&nbsp;payment&nbsp;gateways&nbsp;in&nbsp;connection&nbsp;with&nbsp;Website&nbsp;and/or&nbsp;Vhelp&#39;s&nbsp;products&nbsp;and&nbsp;Services;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;improve&nbsp;and&nbsp;maintain&nbsp;our&nbsp;Website&nbsp;and&nbsp;our&nbsp;Services&nbsp;(for&nbsp;example,&nbsp;we&nbsp;track&nbsp;information&nbsp;entered&nbsp;through&nbsp;the&nbsp;&quot;Search&quot;&nbsp;function;&nbsp;this&nbsp;helps&nbsp;us&nbsp;determine&nbsp;which&nbsp;areas&nbsp;of&nbsp;our&nbsp;Website&nbsp;users&nbsp;like&nbsp;best&nbsp;and&nbsp;areas&nbsp;that&nbsp;we&nbsp;may&nbsp;want&nbsp;to&nbsp;enhance;&nbsp;we&nbsp;also&nbsp;will&nbsp;use&nbsp;for&nbsp;trouble-shooting&nbsp;purposes,&nbsp;where&nbsp;applicable);&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;periodically&nbsp;send&nbsp;promotional&nbsp;emails&nbsp;to&nbsp;the&nbsp;email&nbsp;address&nbsp;you&nbsp;provide&nbsp;regarding&nbsp;new&nbsp;products&nbsp;from&nbsp;Vhelp,&nbsp;special&nbsp;offers&nbsp;from&nbsp;Vhelp&nbsp;or&nbsp;other&nbsp;information&nbsp;about&nbsp;Vhelp&nbsp;that&nbsp;we&nbsp;think&nbsp;you&nbsp;may&nbsp;find&nbsp;interesting;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;contact&nbsp;you&nbsp;via&nbsp;email,&nbsp;telephone,&nbsp;facsimile&nbsp;or&nbsp;mail,&nbsp;or,&nbsp;where&nbsp;requested,&nbsp;by&nbsp;text&nbsp;message,&nbsp;to&nbsp;deliver&nbsp;certain&nbsp;services&nbsp;or&nbsp;information&nbsp;you&nbsp;have&nbsp;requested;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;For&nbsp;Vhelp&#39;s&nbsp;market&nbsp;research&nbsp;purposes,&nbsp;including,&nbsp;but&nbsp;not&nbsp;limited&nbsp;to,&nbsp;the&nbsp;customization&nbsp;of&nbsp;the&nbsp;Website&nbsp;according&nbsp;to&nbsp;your&nbsp;interests;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;We&nbsp;may&nbsp;use&nbsp;your&nbsp;demographic&nbsp;information&nbsp;(i.e.,&nbsp;age,&nbsp;postal&nbsp;code,&nbsp;residential&nbsp;and&nbsp;commercial&nbsp;addresses,&nbsp;and&nbsp;other&nbsp;various&nbsp;data)&nbsp;to&nbsp;more&nbsp;effectively&nbsp;facilitate&nbsp;the&nbsp;promotion&nbsp;of&nbsp;goods&nbsp;and&nbsp;services&nbsp;to&nbsp;appropriate&nbsp;target&nbsp;audiences&nbsp;and&nbsp;for&nbsp;other&nbsp;research&nbsp;and&nbsp;analytical&nbsp;purposes;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;To&nbsp;resolve&nbsp;disputes,&nbsp;to&nbsp;protect&nbsp;ourselves&nbsp;and&nbsp;other&nbsp;users&nbsp;of&nbsp;our&nbsp;Website&nbsp;and&nbsp;Services,&nbsp;and&nbsp;to&nbsp;enforce&nbsp;our&nbsp;Terms&nbsp;of&nbsp;Use;&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;We&nbsp;also&nbsp;may&nbsp;compare&nbsp;personal&nbsp;information&nbsp;collected&nbsp;through&nbsp;the&nbsp;Website&nbsp;and&nbsp;Services&nbsp;to&nbsp;verify&nbsp;its&nbsp;accuracy&nbsp;with&nbsp;personal&nbsp;information&nbsp;collected&nbsp;from&nbsp;third&nbsp;parties;&nbsp;and&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;We&nbsp;may&nbsp;combine&nbsp;aggregate&nbsp;data&nbsp;with&nbsp;the&nbsp;personal&nbsp;information&nbsp;we&nbsp;collect&nbsp;about&nbsp;you.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;li&gt;&nbsp;From&nbsp;time&nbsp;to&nbsp;time,&nbsp;Vhelp&nbsp;may&nbsp;use&nbsp;personal&nbsp;information&nbsp;for&nbsp;new&nbsp;and&nbsp;unanticipated&nbsp;uses&nbsp;not&nbsp;previously&nbsp;disclosed&nbsp;in&nbsp;our&nbsp;Privacy&nbsp;Policy.&nbsp;If&nbsp;our&nbsp;information&nbsp;practices&nbsp;change&nbsp;regarding&nbsp;information&nbsp;previously&nbsp;collected,&nbsp;Vhelp&nbsp;shall&nbsp;make&nbsp;reasonable&nbsp;efforts&nbsp;to&nbsp;provide&nbsp;notice&nbsp;and&nbsp;obtain&nbsp;consent&nbsp;of&nbsp;any&nbsp;such&nbsp;uses&nbsp;as&nbsp;may&nbsp;be&nbsp;required&nbsp;by&nbsp;law.&nbsp;&lt;/li&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/ul&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;C.&nbsp;Electronic&nbsp;Newsletters,&nbsp;Invitations,&nbsp;Polls&nbsp;and&nbsp;Surveys&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;At&nbsp;our&nbsp;sole&nbsp;discretion,&nbsp;Vhelp&nbsp;may&nbsp;offer&nbsp;any&nbsp;of&nbsp;the&nbsp;following&nbsp;free&nbsp;services&nbsp;on&nbsp;the&nbsp;Website,&nbsp;which&nbsp;you&nbsp;may&nbsp;select&nbsp;to&nbsp;use&nbsp;or&nbsp;receive&nbsp;at&nbsp;your&nbsp;option.&nbsp;Certain&nbsp;of&nbsp;the&nbsp;following&nbsp;services&nbsp;may&nbsp;require&nbsp;you&nbsp;to&nbsp;provide&nbsp;additional&nbsp;personal&nbsp;information&nbsp;as&nbsp;detailed&nbsp;below:&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;1.&nbsp;ELECTRONIC&nbsp;NEWSLETTERS&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;offer&nbsp;a&nbsp;free&nbsp;electronic&nbsp;newsletter&nbsp;to&nbsp;users.&nbsp;We&nbsp;will&nbsp;gather&nbsp;the&nbsp;email&nbsp;addresses&nbsp;of&nbsp;users&nbsp;who&nbsp;sign&nbsp;up&nbsp;for&nbsp;Vhelp&nbsp;for&nbsp;the&nbsp;newsletter&nbsp;mailing&nbsp;list.&nbsp;Users&nbsp;may&nbsp;remove&nbsp;themselves&nbsp;from&nbsp;this&nbsp;mailing&nbsp;list&nbsp;by&nbsp;opting&nbsp;out&nbsp;of&nbsp;receiving&nbsp;newsletters&nbsp;during&nbsp;the&nbsp;registration&nbsp;process,&nbsp;by&nbsp;following&nbsp;the&nbsp;link&nbsp;provided&nbsp;in&nbsp;each&nbsp;newsletter&nbsp;that&nbsp;points&nbsp;users&nbsp;to&nbsp;a&nbsp;subscription&nbsp;management&nbsp;page&nbsp;where&nbsp;the&nbsp;user&nbsp;can&nbsp;unsubscribe&nbsp;from&nbsp;receiving&nbsp;newsletters&nbsp;or&nbsp;by&nbsp;changing&nbsp;their&nbsp;preferences&nbsp;in&nbsp;their&nbsp;Profile&nbsp;Settings&nbsp;page.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;2.&nbsp;&quot;SEND&nbsp;TO&nbsp;A&nbsp;FRIEND&quot;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Our&nbsp;Website&nbsp;users&nbsp;can&nbsp;voluntarily&nbsp;choose&nbsp;to&nbsp;electronically&nbsp;forward&nbsp;a&nbsp;link,&nbsp;page,&nbsp;or&nbsp;document&nbsp;to&nbsp;someone&nbsp;else&nbsp;by&nbsp;clicking&nbsp;&quot;send&nbsp;to&nbsp;a&nbsp;friend.&quot;&nbsp;To&nbsp;do&nbsp;so,&nbsp;the&nbsp;user&nbsp;must&nbsp;provide&nbsp;his&nbsp;or&nbsp;her&nbsp;email&nbsp;address,&nbsp;as&nbsp;well&nbsp;as&nbsp;the&nbsp;email&nbsp;address&nbsp;of&nbsp;the&nbsp;recipient.&nbsp;The&nbsp;user&#39;s&nbsp;email&nbsp;address&nbsp;is&nbsp;used&nbsp;only&nbsp;in&nbsp;the&nbsp;case&nbsp;of&nbsp;transmission&nbsp;errors&nbsp;and,&nbsp;of&nbsp;course,&nbsp;to&nbsp;let&nbsp;the&nbsp;recipient&nbsp;know&nbsp;who&nbsp;sent&nbsp;the&nbsp;email.&nbsp;The&nbsp;information&nbsp;is&nbsp;not&nbsp;used&nbsp;for&nbsp;any&nbsp;other&nbsp;purpose.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;3.&nbsp;POLLING&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;offer&nbsp;interactive&nbsp;polls&nbsp;to&nbsp;users&nbsp;so&nbsp;they&nbsp;can&nbsp;easily&nbsp;share&nbsp;their&nbsp;opinions&nbsp;with&nbsp;other&nbsp;users&nbsp;and&nbsp;see&nbsp;what&nbsp;our&nbsp;audience&nbsp;thinks&nbsp;about&nbsp;important&nbsp;issues,&nbsp;Services,&nbsp;and/or&nbsp;the&nbsp;Website.&nbsp;Opinions&nbsp;or&nbsp;other&nbsp;responses&nbsp;to&nbsp;polls&nbsp;are&nbsp;aggregated&nbsp;and&nbsp;are&nbsp;not&nbsp;identifiable&nbsp;to&nbsp;any&nbsp;particular&nbsp;user.&nbsp;We&nbsp;may&nbsp;use&nbsp;a&nbsp;system&nbsp;to&nbsp;&quot;tag&quot;&nbsp;users&nbsp;after&nbsp;they&nbsp;have&nbsp;voted,&nbsp;so&nbsp;they&nbsp;can&nbsp;vote&nbsp;only&nbsp;once&nbsp;on&nbsp;a&nbsp;particular&nbsp;question.&nbsp;This&nbsp;tag&nbsp;is&nbsp;not&nbsp;correlated&nbsp;with&nbsp;information&nbsp;about&nbsp;individual&nbsp;users.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;4.&nbsp;SURVEYS&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;conduct&nbsp;user&nbsp;surveys&nbsp;from&nbsp;time&nbsp;to&nbsp;time&nbsp;to&nbsp;better&nbsp;target&nbsp;our&nbsp;content&nbsp;to&nbsp;our&nbsp;Website&nbsp;users.&nbsp;We&nbsp;will&nbsp;not&nbsp;share&nbsp;individual&nbsp;responses&nbsp;from&nbsp;these&nbsp;surveys&nbsp;with&nbsp;any&nbsp;third&nbsp;party.&nbsp;We&nbsp;will&nbsp;share&nbsp;aggregate&nbsp;data&nbsp;with&nbsp;third&nbsp;party&nbsp;service&nbsp;providers,&nbsp;partners,&nbsp;and&nbsp;other&nbsp;third&nbsp;parties.&nbsp;We&nbsp;also&nbsp;will&nbsp;post&nbsp;aggregate&nbsp;data&nbsp;containing&nbsp;survey&nbsp;responses&nbsp;on&nbsp;our&nbsp;Website;&nbsp;that&nbsp;data&nbsp;may&nbsp;be&nbsp;viewed&nbsp;and&nbsp;downloaded&nbsp;by&nbsp;other&nbsp;users&nbsp;of&nbsp;our&nbsp;Website.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;D.&nbsp;Security&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;employ&nbsp;procedural&nbsp;and&nbsp;technological&nbsp;security&nbsp;measures,&nbsp;which&nbsp;are&nbsp;reasonably&nbsp;designed&nbsp;to&nbsp;help&nbsp;protect&nbsp;your&nbsp;personal&nbsp;information&nbsp;from&nbsp;unauthorized&nbsp;access&nbsp;or&nbsp;disclosure.&nbsp;Vhelp&nbsp;may&nbsp;use&nbsp;encryption,&nbsp;passwords,&nbsp;and&nbsp;physical&nbsp;security&nbsp;measures&nbsp;to&nbsp;help&nbsp;protect&nbsp;your&nbsp;personal&nbsp;information&nbsp;against&nbsp;unauthorized&nbsp;access&nbsp;and&nbsp;disclosure.&nbsp;No&nbsp;security&nbsp;measures,&nbsp;however,&nbsp;are&nbsp;100%&nbsp;complete.&nbsp;Therefore,&nbsp;we&nbsp;do&nbsp;not&nbsp;promise&nbsp;and&nbsp;cannot&nbsp;guarantee,&nbsp;and&nbsp;thus&nbsp;you&nbsp;should&nbsp;not&nbsp;expect,&nbsp;that&nbsp;your&nbsp;personal&nbsp;information&nbsp;or&nbsp;private&nbsp;communications&nbsp;will&nbsp;not&nbsp;be&nbsp;collected&nbsp;and&nbsp;used&nbsp;by&nbsp;others.&nbsp;You&nbsp;should&nbsp;take&nbsp;steps&nbsp;to&nbsp;protect&nbsp;against&nbsp;unauthorized&nbsp;access&nbsp;to&nbsp;your&nbsp;password,&nbsp;phone,&nbsp;and&nbsp;computer&nbsp;by,&nbsp;among&nbsp;other&nbsp;things,&nbsp;signing&nbsp;off&nbsp;after&nbsp;using&nbsp;a&nbsp;shared&nbsp;computer,&nbsp;choosing&nbsp;a&nbsp;robust&nbsp;password&nbsp;that&nbsp;nobody&nbsp;else&nbsp;knows&nbsp;or&nbsp;can&nbsp;easily&nbsp;guess,&nbsp;and&nbsp;keeping&nbsp;your&nbsp;log-in&nbsp;and&nbsp;password&nbsp;private.&nbsp;Vhelp&nbsp;is&nbsp;not&nbsp;responsible&nbsp;for&nbsp;the&nbsp;unauthorized&nbsp;use&nbsp;of&nbsp;your&nbsp;information&nbsp;or&nbsp;for&nbsp;any&nbsp;lost,&nbsp;stolen,&nbsp;compromised&nbsp;passwords,&nbsp;or&nbsp;for&nbsp;any&nbsp;activity&nbsp;on&nbsp;your&nbsp;Account&nbsp;via&nbsp;unauthorized&nbsp;password&nbsp;activity.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;E.&nbsp;Disclosure&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;share&nbsp;the&nbsp;information&nbsp;that&nbsp;we&nbsp;collect&nbsp;about&nbsp;you,&nbsp;including&nbsp;your&nbsp;personal&nbsp;information,&nbsp;as&nbsp;follows:&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;1.&nbsp;INFORMATION&nbsp;DISCLOSED&nbsp;TO&nbsp;PROTECT&nbsp;US&nbsp;AND&nbsp;OTHERS&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;disclose&nbsp;your&nbsp;information&nbsp;including&nbsp;Personal&nbsp;Information&nbsp;if:&nbsp;(i)&nbsp;Vhelp&nbsp;reasonably&nbsp;believes&nbsp;that&nbsp;disclosure&nbsp;is&nbsp;necessary&nbsp;in&nbsp;order&nbsp;to&nbsp;comply&nbsp;with&nbsp;a&nbsp;legal&nbsp;process&nbsp;(such&nbsp;as&nbsp;a&nbsp;court&nbsp;order,&nbsp;search&nbsp;warrant,&nbsp;etc.)&nbsp;or&nbsp;other&nbsp;legal&nbsp;requirement&nbsp;of&nbsp;any&nbsp;governmental&nbsp;authority,&nbsp;(ii)&nbsp;disclosure&nbsp;would&nbsp;potentially&nbsp;mitigate&nbsp;our&nbsp;liability&nbsp;in&nbsp;an&nbsp;actual&nbsp;or&nbsp;potential&nbsp;lawsuit,&nbsp;(iii)&nbsp;reasonably&nbsp;necessary&nbsp;to&nbsp;enforce&nbsp;this&nbsp;Privacy&nbsp;Policy,&nbsp;our&nbsp;Terms&nbsp;of&nbsp;Use&nbsp;etc.&nbsp;(iv)&nbsp;disclosure&nbsp;is&nbsp;intended&nbsp;to&nbsp;help&nbsp;investigate&nbsp;or&nbsp;prevent&nbsp;unauthorized&nbsp;transactions&nbsp;or&nbsp;other&nbsp;illegal&nbsp;activities,&nbsp;or&nbsp;(v)&nbsp;necessary&nbsp;or&nbsp;appropriate&nbsp;to&nbsp;protect&nbsp;our&nbsp;rights&nbsp;or&nbsp;property,&nbsp;or&nbsp;the&nbsp;rights&nbsp;or&nbsp;property&nbsp;of&nbsp;any&nbsp;person&nbsp;or&nbsp;entity.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;2.&nbsp;INFORMATION&nbsp;DISCLOSED&nbsp;TO&nbsp;THIRD&nbsp;PARTY&nbsp;SERVICE&nbsp;PROVIDERS&nbsp;AND&nbsp;BUSINESS&nbsp;PARTNERS&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;contract&nbsp;with&nbsp;various&nbsp;third&nbsp;parties&nbsp;for&nbsp;the&nbsp;provision&nbsp;and&nbsp;maintenance&nbsp;of&nbsp;the&nbsp;Website,&nbsp;Services&nbsp;and&nbsp;our&nbsp;business&nbsp;operations,&nbsp;and&nbsp;Vhelp&nbsp;may&nbsp;need&nbsp;to&nbsp;share&nbsp;your&nbsp;personal&nbsp;information&nbsp;and&nbsp;data&nbsp;generated&nbsp;by&nbsp;cookies&nbsp;and&nbsp;aggregate&nbsp;information&nbsp;(collectively,&nbsp;&quot;information&quot;)&nbsp;with&nbsp;these&nbsp;vendors&nbsp;and&nbsp;service&nbsp;agencies.&nbsp;For&nbsp;example,&nbsp;we&nbsp;may&nbsp;provide&nbsp;your&nbsp;information&nbsp;to&nbsp;a&nbsp;credit&nbsp;card&nbsp;processing&nbsp;company&nbsp;to&nbsp;process&nbsp;your&nbsp;payment.&nbsp;The&nbsp;vendors&nbsp;and&nbsp;service&nbsp;agencies&nbsp;will&nbsp;not&nbsp;receive&nbsp;any&nbsp;right&nbsp;to&nbsp;use&nbsp;your&nbsp;personal&nbsp;information&nbsp;beyond&nbsp;what&nbsp;is&nbsp;necessary&nbsp;to&nbsp;perform&nbsp;its&nbsp;obligations&nbsp;to&nbsp;provide&nbsp;the&nbsp;Services&nbsp;to&nbsp;you.&nbsp;If&nbsp;you&nbsp;complete&nbsp;a&nbsp;survey,&nbsp;we&nbsp;also&nbsp;may&nbsp;share&nbsp;your&nbsp;information&nbsp;with&nbsp;the&nbsp;survey&nbsp;provider;&nbsp;if&nbsp;we&nbsp;offer&nbsp;a&nbsp;survey&nbsp;in&nbsp;conjunction&nbsp;with&nbsp;another&nbsp;entity,&nbsp;we&nbsp;also&nbsp;will&nbsp;disclose&nbsp;the&nbsp;results&nbsp;to&nbsp;that&nbsp;entity.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;3.&nbsp;DISCLOSURE&nbsp;TO&nbsp;NON-AFFILIATED&nbsp;THIRD&nbsp;PARTIES&nbsp;IN&nbsp;FURTHERANCE&nbsp;OF&nbsp;YOUR&nbsp;REQUEST&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;Your&nbsp;request&nbsp;for&nbsp;services&nbsp;may&nbsp;be&nbsp;shared&nbsp;with&nbsp;third&nbsp;party&nbsp;websites&nbsp;with&nbsp;whom&nbsp;we&nbsp;have&nbsp;a&nbsp;contractual&nbsp;relationship&nbsp;in&nbsp;order&nbsp;to&nbsp;provide&nbsp;your&nbsp;request&nbsp;with&nbsp;maximum&nbsp;exposure.&nbsp;The&nbsp;post&nbsp;on&nbsp;the&nbsp;third&nbsp;party&nbsp;website&nbsp;will&nbsp;include&nbsp;the&nbsp;details&nbsp;of&nbsp;your&nbsp;request,&nbsp;including&nbsp;your&nbsp;location,&nbsp;and&nbsp;other&nbsp;contact&nbsp;details.&nbsp;Interested&nbsp;bidders,&nbsp;however,&nbsp;will&nbsp;be&nbsp;able&nbsp;to&nbsp;click&nbsp;on&nbsp;your&nbsp;request&nbsp;on&nbsp;such&nbsp;third&nbsp;party&nbsp;site,&nbsp;and&nbsp;will&nbsp;be&nbsp;directed&nbsp;to&nbsp;our&nbsp;Website&nbsp;where&nbsp;they&nbsp;will&nbsp;have&nbsp;access&nbsp;to&nbsp;your&nbsp;contact&nbsp;details&nbsp;(Partial&nbsp;or&nbsp;complete),&nbsp;as&nbsp;would&nbsp;any&nbsp;other&nbsp;service&nbsp;provider&nbsp;on&nbsp;our&nbsp;Website&nbsp;interested&nbsp;in&nbsp;bidding&nbsp;on&nbsp;your&nbsp;request.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;4.&nbsp;DISCLOSURE&nbsp;TO&nbsp;OTHER&nbsp;USERS&nbsp;OF&nbsp;OUR&nbsp;WEBSITE&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;If&nbsp;you&nbsp;are&nbsp;a&nbsp;Service&nbsp;Professional,&nbsp;the&nbsp;information&nbsp;that&nbsp;you&nbsp;post&nbsp;(other&nbsp;than&nbsp;your&nbsp;payment&nbsp;information)&nbsp;is&nbsp;available&nbsp;to&nbsp;other&nbsp;users&nbsp;of&nbsp;our&nbsp;Website&nbsp;and&nbsp;our&nbsp;Services.&nbsp;Comments&nbsp;that&nbsp;users&nbsp;post&nbsp;to&nbsp;our&nbsp;Website&nbsp;also&nbsp;will&nbsp;be&nbsp;available&nbsp;to&nbsp;other&nbsp;visitors&nbsp;to&nbsp;our&nbsp;Website&nbsp;(see&nbsp;our&nbsp;discussion&nbsp;of&nbsp;User&nbsp;Generated&nbsp;Content&nbsp;below).&nbsp;In&nbsp;addition,&nbsp;we&nbsp;will&nbsp;post&nbsp;the&nbsp;results&nbsp;(in&nbsp;aggregate&nbsp;form)&nbsp;of&nbsp;surveys&nbsp;to&nbsp;our&nbsp;Website.&nbsp;If&nbsp;you&nbsp;are&nbsp;a&nbsp;consumer,&nbsp;name,&nbsp;and&nbsp;location,&nbsp;as&nbsp;well&nbsp;as&nbsp;the&nbsp;details&nbsp;of&nbsp;your&nbsp;request,&nbsp;are&nbsp;available&nbsp;to&nbsp;all&nbsp;visitors&nbsp;to&nbsp;our&nbsp;Website.&nbsp;Bidding&nbsp;professionals&nbsp;also&nbsp;will&nbsp;be&nbsp;permitted&nbsp;to&nbsp;see&nbsp;the&nbsp;consumer&#39;s&nbsp;full&nbsp;name,&nbsp;telephone&nbsp;number,&nbsp;email&nbsp;address&nbsp;and&nbsp;the&nbsp;-location&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;5.&nbsp;INFORMATION&nbsp;DISCLOSED&nbsp;TO&nbsp;LAW&nbsp;ENFORCEMENT&nbsp;OR&nbsp;GOVERNMENT&nbsp;OFFICIALS&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;will&nbsp;disclose&nbsp;your&nbsp;information,&nbsp;including,&nbsp;without&nbsp;limitation,&nbsp;your&nbsp;name,&nbsp;city,&nbsp;state,&nbsp;telephone&nbsp;number,&nbsp;email&nbsp;address,&nbsp;user&nbsp;ID&nbsp;history,&nbsp;q