inciples&nbsp;affecting&nbsp;creditors&#39;&nbsp;rights&nbsp;generally,&nbsp;Vhelp&nbsp;may&nbsp;not&nbsp;be&nbsp;able&nbsp;to&nbsp;control&nbsp;how&nbsp;your&nbsp;information&nbsp;is&nbsp;transferred,&nbsp;used,&nbsp;or&nbsp;treated&nbsp;and&nbsp;reserves&nbsp;the&nbsp;right&nbsp;to&nbsp;transfer&nbsp;the&nbsp;information&nbsp;we&nbsp;have&nbsp;collected&nbsp;from&nbsp;the&nbsp;users&nbsp;of&nbsp;the&nbsp;Website&nbsp;and/or&nbsp;Services&nbsp;to&nbsp;non-affiliated&nbsp;third&nbsp;parties&nbsp;in&nbsp;such&nbsp;event.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;7.&nbsp;INFORMATION&nbsp;DISCLOSED&nbsp;AT&nbsp;YOUR&nbsp;REQUEST&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;share&nbsp;your&nbsp;personal&nbsp;information&nbsp;with&nbsp;other&nbsp;Registered&nbsp;Users&nbsp;to&nbsp;whom&nbsp;you&nbsp;explicitly&nbsp;ask&nbsp;us&nbsp;to&nbsp;send&nbsp;your&nbsp;information&nbsp;or&nbsp;if&nbsp;you&nbsp;explicitly&nbsp;consent&nbsp;to&nbsp;such&nbsp;disclosure&nbsp;upon&nbsp;receipt&nbsp;of&nbsp;a&nbsp;specific&nbsp;Service.&nbsp;For&nbsp;instance,&nbsp;when&nbsp;you&nbsp;contract&nbsp;for&nbsp;a&nbsp;specific&nbsp;Service&nbsp;with&nbsp;another&nbsp;Registered&nbsp;User,&nbsp;Vhelp&nbsp;will&nbsp;send&nbsp;that&nbsp;Registered&nbsp;User&nbsp;a&nbsp;notice&nbsp;that&nbsp;includes&nbsp;the&nbsp;personal&nbsp;information&nbsp;that&nbsp;you&nbsp;have&nbsp;chosen&nbsp;to&nbsp;allow&nbsp;Vhelp&nbsp;to&nbsp;reveal&nbsp;to&nbsp;users&nbsp;with&nbsp;whom&nbsp;you&nbsp;contract.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;F.&nbsp;Links&nbsp;to&nbsp;External&nbsp;Websites&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;The&nbsp;Website&nbsp;may&nbsp;contain&nbsp;links&nbsp;to&nbsp;other&nbsp;websites&nbsp;or&nbsp;resources&nbsp;over&nbsp;which&nbsp;Vhelp&nbsp;does&nbsp;not&nbsp;have&nbsp;any&nbsp;control.&nbsp;Such&nbsp;links&nbsp;do&nbsp;not&nbsp;constitute&nbsp;an&nbsp;endorsement&nbsp;by&nbsp;Vhelp&nbsp;of&nbsp;those&nbsp;external&nbsp;websites.&nbsp;You&nbsp;acknowledge&nbsp;that&nbsp;Vhelp&nbsp;is&nbsp;providing&nbsp;these&nbsp;links&nbsp;to&nbsp;you&nbsp;only&nbsp;as&nbsp;a&nbsp;convenience,&nbsp;and&nbsp;further&nbsp;agree&nbsp;that&nbsp;Vhelp&nbsp;is&nbsp;not&nbsp;responsible&nbsp;for&nbsp;the&nbsp;content&nbsp;of&nbsp;such&nbsp;external&nbsp;websites.&nbsp;We&nbsp;are&nbsp;not&nbsp;responsible&nbsp;for&nbsp;the&nbsp;protection&nbsp;and&nbsp;privacy&nbsp;of&nbsp;any&nbsp;information&nbsp;which&nbsp;you&nbsp;provide&nbsp;while&nbsp;visiting&nbsp;such&nbsp;external&nbsp;websites&nbsp;and&nbsp;such&nbsp;sites&nbsp;are&nbsp;not&nbsp;governed&nbsp;by&nbsp;this&nbsp;Policy.&nbsp;Your&nbsp;use&nbsp;of&nbsp;any&nbsp;external&nbsp;website&nbsp;is&nbsp;subject&nbsp;to&nbsp;the&nbsp;terms&nbsp;of&nbsp;use&nbsp;and&nbsp;privacy&nbsp;policy&nbsp;located&nbsp;on&nbsp;the&nbsp;linked&nbsp;to&nbsp;external&nbsp;website.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;G.&nbsp;Updating,&nbsp;Deleting&nbsp;and&nbsp;Correcting&nbsp;Your&nbsp;Personal&nbsp;Information&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;You&nbsp;may&nbsp;choose&nbsp;to&nbsp;restrict&nbsp;the&nbsp;collection&nbsp;or&nbsp;use&nbsp;of&nbsp;your&nbsp;personal&nbsp;information&nbsp;in&nbsp;the&nbsp;following&nbsp;ways:&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;You&nbsp;can&nbsp;review,&nbsp;correct&nbsp;and&nbsp;delete&nbsp;your&nbsp;personal&nbsp;information&nbsp;by&nbsp;logging&nbsp;into&nbsp;the&nbsp;Website&nbsp;and&nbsp;navigating&nbsp;to&nbsp;your&nbsp;preferences&nbsp;page&nbsp;in&nbsp;&quot;Edit&nbsp;Profile.&quot;&nbsp;You&nbsp;must&nbsp;promptly&nbsp;update&nbsp;your&nbsp;personal&nbsp;information&nbsp;if&nbsp;it&nbsp;changes&nbsp;or&nbsp;is&nbsp;inaccurate.&nbsp;Typically,&nbsp;we&nbsp;will&nbsp;not&nbsp;manually&nbsp;alter&nbsp;your&nbsp;personal&nbsp;information&nbsp;because&nbsp;it&nbsp;is&nbsp;very&nbsp;difficult&nbsp;to&nbsp;verify&nbsp;your&nbsp;identity&nbsp;remotely.&nbsp;Nonetheless,&nbsp;upon&nbsp;your&nbsp;request&nbsp;we&nbsp;will&nbsp;close&nbsp;your&nbsp;Account&nbsp;and&nbsp;remove&nbsp;your&nbsp;personal&nbsp;information&nbsp;from&nbsp;view&nbsp;as&nbsp;soon&nbsp;as&nbsp;reasonably&nbsp;possible&nbsp;based&nbsp;on&nbsp;your&nbsp;Account&nbsp;activity&nbsp;and&nbsp;in&nbsp;accordance&nbsp;with&nbsp;applicable&nbsp;law.&nbsp;We&nbsp;do&nbsp;retain&nbsp;information&nbsp;from&nbsp;closed&nbsp;Accounts&nbsp;in&nbsp;order&nbsp;to&nbsp;comply&nbsp;with&nbsp;the&nbsp;law,&nbsp;prevent&nbsp;fraud,&nbsp;collect&nbsp;any&nbsp;fees&nbsp;owed,&nbsp;resolve&nbsp;disputes,&nbsp;troubleshoot&nbsp;problems,&nbsp;assist&nbsp;with&nbsp;any&nbsp;investigations&nbsp;of&nbsp;any&nbsp;Registered&nbsp;User,&nbsp;enforce&nbsp;our&nbsp;Terms&nbsp;of&nbsp;Use,&nbsp;and&nbsp;take&nbsp;any&nbsp;other&nbsp;actions&nbsp;otherwise&nbsp;permitted&nbsp;by&nbsp;law&nbsp;that&nbsp;we&nbsp;deem&nbsp;necessary&nbsp;in&nbsp;our&nbsp;sole&nbsp;and&nbsp;absolute&nbsp;discretion.&nbsp;You&nbsp;should&nbsp;understand,&nbsp;however,&nbsp;that&nbsp;once&nbsp;you&nbsp;publicly&nbsp;post&nbsp;a&nbsp;Request,&nbsp;Offer,&nbsp;Want,&nbsp;Feedback,&nbsp;or&nbsp;any&nbsp;other&nbsp;information&nbsp;onto&nbsp;the&nbsp;Website,&nbsp;you&nbsp;may&nbsp;not&nbsp;be&nbsp;able&nbsp;to&nbsp;change&nbsp;or&nbsp;remove&nbsp;it.&nbsp;Once&nbsp;we&nbsp;have&nbsp;deleted&nbsp;or&nbsp;removed&nbsp;your&nbsp;Account,&nbsp;you&nbsp;agree&nbsp;that&nbsp;Vhelp&nbsp;shall&nbsp;not&nbsp;be&nbsp;responsible&nbsp;for&nbsp;any&nbsp;personal&nbsp;information&nbsp;that&nbsp;was&nbsp;not&nbsp;included&nbsp;within&nbsp;your&nbsp;deleted&nbsp;and/or&nbsp;removed&nbsp;Account&nbsp;that&nbsp;remains&nbsp;on&nbsp;the&nbsp;Website.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;&nbsp;H.&nbsp;What&nbsp;Choices&nbsp;Do&nbsp;I&nbsp;Have&nbsp;Regarding&nbsp;Use&nbsp;of&nbsp;My&nbsp;Personal&nbsp;Information?&nbsp;&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;may&nbsp;send&nbsp;periodic&nbsp;promotional&nbsp;or&nbsp;informational&nbsp;emails&nbsp;to&nbsp;you.&nbsp;You&nbsp;may&nbsp;opt-out&nbsp;of&nbsp;such&nbsp;communications&nbsp;by&nbsp;following&nbsp;the&nbsp;opt-out&nbsp;instructions&nbsp;contained&nbsp;in&nbsp;the&nbsp;email.&nbsp;Please&nbsp;note&nbsp;that&nbsp;it&nbsp;may&nbsp;take&nbsp;up&nbsp;to&nbsp;10&nbsp;business&nbsp;days&nbsp;for&nbsp;us&nbsp;to&nbsp;process&nbsp;opt-out&nbsp;requests.&nbsp;If&nbsp;you&nbsp;opt-out&nbsp;of&nbsp;receiving&nbsp;emails&nbsp;about&nbsp;recommendations&nbsp;or&nbsp;other&nbsp;information&nbsp;we&nbsp;think&nbsp;may&nbsp;interest&nbsp;you,&nbsp;we&nbsp;may&nbsp;still&nbsp;send&nbsp;you&nbsp;emails&nbsp;about&nbsp;your&nbsp;Account&nbsp;or&nbsp;any&nbsp;Services&nbsp;you&nbsp;have&nbsp;requested&nbsp;or&nbsp;received&nbsp;from&nbsp;us.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;I.&nbsp;Third-Party&nbsp;Ad&nbsp;Networks&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;We&nbsp;participate&nbsp;in&nbsp;third&nbsp;party&nbsp;ad&nbsp;networks&nbsp;that&nbsp;may&nbsp;display&nbsp;advertisements&nbsp;on&nbsp;other&nbsp;websites&nbsp;based&nbsp;on&nbsp;your&nbsp;visits&nbsp;to&nbsp;our&nbsp;Site&nbsp;as&nbsp;well&nbsp;as&nbsp;other&nbsp;websites.&nbsp;This&nbsp;enables&nbsp;us&nbsp;and&nbsp;these&nbsp;third&nbsp;parties&nbsp;to&nbsp;target&nbsp;advertisements&nbsp;by&nbsp;displaying&nbsp;ads&nbsp;for&nbsp;products&nbsp;and&nbsp;services&nbsp;in&nbsp;which&nbsp;you&nbsp;might&nbsp;be&nbsp;interested.&nbsp;Third&nbsp;party&nbsp;ad&nbsp;network&nbsp;providers,&nbsp;advertisers,&nbsp;sponsors&nbsp;and/or&nbsp;traffic&nbsp;measurement&nbsp;services&nbsp;may&nbsp;use&nbsp;cookies,&nbsp;JavaScript,&nbsp;web&nbsp;beacons&nbsp;(including&nbsp;clear&nbsp;GIFs),&nbsp;Flash&nbsp;LSOs&nbsp;and&nbsp;other&nbsp;technologies&nbsp;to&nbsp;measure&nbsp;the&nbsp;effectiveness&nbsp;of&nbsp;their&nbsp;ads&nbsp;and&nbsp;to&nbsp;personalize&nbsp;advertising&nbsp;content&nbsp;to&nbsp;you.&nbsp;These&nbsp;third&nbsp;party&nbsp;cookies&nbsp;and&nbsp;other&nbsp;technologies&nbsp;are&nbsp;governed&nbsp;by&nbsp;each&nbsp;third&nbsp;party&#39;s&nbsp;specific&nbsp;privacy&nbsp;policy,&nbsp;and&nbsp;not&nbsp;by&nbsp;Vhelp&rsquo;s&nbsp;Policy.&nbsp;We&nbsp;may&nbsp;provide&nbsp;these&nbsp;third-party&nbsp;advertisers&nbsp;with&nbsp;information&nbsp;about&nbsp;your&nbsp;usage&nbsp;of&nbsp;our&nbsp;Site&nbsp;and&nbsp;our&nbsp;services,&nbsp;as&nbsp;well&nbsp;as&nbsp;aggregate&nbsp;or&nbsp;non-personally&nbsp;identifiable&nbsp;information&nbsp;about&nbsp;visitors&nbsp;to&nbsp;our&nbsp;Site&nbsp;and&nbsp;users&nbsp;of&nbsp;our&nbsp;service.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;J.&nbsp;Your&nbsp;Full&nbsp;Name&nbsp;and&nbsp;Use&nbsp;of&nbsp;Vhelp&nbsp;Information&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;1.&nbsp;YOUR&nbsp;FULL&nbsp;NAME&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;As&nbsp;a&nbsp;Registered&nbsp;User&nbsp;of&nbsp;the&nbsp;Website&nbsp;you&nbsp;will&nbsp;select&nbsp;a&nbsp;Full&nbsp;Name&nbsp;during&nbsp;the&nbsp;registration&nbsp;process.&nbsp;All&nbsp;of&nbsp;your&nbsp;activities&nbsp;on&nbsp;the&nbsp;Website&nbsp;will&nbsp;be&nbsp;traceable&nbsp;to&nbsp;your&nbsp;Full&nbsp;Name.&nbsp;Certain&nbsp;other&nbsp;people,&nbsp;including&nbsp;other&nbsp;Registered&nbsp;Users&nbsp;with&nbsp;whom&nbsp;you&nbsp;have&nbsp;transacted&nbsp;business&nbsp;via&nbsp;the&nbsp;Website,&nbsp;can&nbsp;see&nbsp;a&nbsp;large&nbsp;part&nbsp;of&nbsp;your&nbsp;activity&nbsp;on&nbsp;the&nbsp;Website.&nbsp;If&nbsp;you&nbsp;book&nbsp;a&nbsp;service&nbsp;with&nbsp;a&nbsp;Registered&nbsp;User,&nbsp;cancel&nbsp;a&nbsp;scheduled&nbsp;service&nbsp;with&nbsp;a&nbsp;Registered&nbsp;User,&nbsp;receive&nbsp;an&nbsp;offer&nbsp;on&nbsp;your&nbsp;posted&nbsp;service&nbsp;from&nbsp;a&nbsp;Registered&nbsp;User,&nbsp;or&nbsp;have&nbsp;posted&nbsp;a&nbsp;service,&nbsp;Vhelp&nbsp;may&nbsp;send&nbsp;a&nbsp;notice&nbsp;to&nbsp;you&nbsp;or&nbsp;the&nbsp;appropriate&nbsp;Registered&nbsp;User&nbsp;that&nbsp;includes&nbsp;your&nbsp;Full&nbsp;Name.&nbsp;Thus,&nbsp;if&nbsp;you&nbsp;associate&nbsp;your&nbsp;real&nbsp;name&nbsp;with&nbsp;your&nbsp;Full&nbsp;Name,&nbsp;the&nbsp;people&nbsp;to&nbsp;whom&nbsp;you&nbsp;have&nbsp;revealed&nbsp;your&nbsp;name&nbsp;may&nbsp;be&nbsp;able&nbsp;to&nbsp;personally&nbsp;identify&nbsp;your&nbsp;Website&nbsp;activities.&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;&lt;strong&gt;2.&nbsp;USING&nbsp;INFORMATION&nbsp;FROM&nbsp;Vhelp&lt;/strong&gt;&lt;/p&gt;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;p&gt;&nbsp;The&nbsp;Website&nbsp;facilitates&nbsp;your&nbsp;sharing&nbsp;of&nbsp;personal&nbsp;information&nbsp;with&nbsp;others&nbsp;in&nbsp;order&nbsp;to&nbsp;negotiate,&nbsp;provide,&nbsp;and&nbsp;use&nbsp;the&nbsp;Services.&nbsp;If&nbsp;you&nbsp;agree&nbsp;to&nbsp;contract&nbsp;for&nbsp;a&nbsp;service&nbsp;with&nbsp;another&nbsp;Registered&nbsp;User,&nbsp;you&nbsp;may&nbsp;need&nbsp;to&nbsp;reveal&nbsp;your&nbsp;name,&nbsp;email,&nbsp;phone&nbsp;number,&nbsp;or&nbsp;personal&nbsp;address&nbsp;to&nbsp;that&nbsp;individual&nbsp;so&nbsp;that&nbsp;the&nbsp;service&nbsp;may&nbsp;